INSERT INTO `categories` VALUES
(1,'كرة عالمية','كرة-عالمية','تعرف على أخبار كرة القدم العالمية. نقدم لك آخر التحديثات والمستجدات في عالم كرة القدم على الصعيدين الوطني والدولي. ابقَ على اطلاع دائم بكل ما يتعلق بنجوم كرة القدم.',NULL),
(2,'الدوري الإسباني','الدوري-الإسباني','استمتع بمتابعة أحدث أخبار وأحداث الدوري الإسباني الشهير. تعرف على أحدث التطورات فيما يخص الأندية، والمدربين، واللاعبين. اكتشف تفاصيل المباريات القادمة والماضية، بالإضافة إلى إحصائيات وتحليلات معمقة لأداء الفرق.',1),
(3,'دوري أبطال أوروبا','دوري-أبطال-أوروبا','عالم دوري أبطال أوروبا \"يويفا تشامبيونز ليغ\" على موقعنا كورة live. اطلع على أحدث الأخبار، المعلومات، الفرق، واللاعبين المشاركين في أعرق البطولات الكروية في أوروبا. اكتشف تفاصيل المباريات، جداول التصفيات، نتائج المباريات وتحليلاتها.',1),
(4,'الدوري الانجليزي الممتاز','الدوري-الانجليزي-الممتاز','استكشف عالمًا مثيرًا من أفضل أندية كرة القدم في إنجلترا وأقوى المنافسات. اطلع على آخر الأخبار والتحديثات، وتعرف على التشكيلات، والمعلومات حول اللاعبين والمدربين. اكتشف جداول المباريات ونتائجها، بالإضافة إلى تحليلات معمقة للأحداث الرياضية.',1),
(5,'الدوري الفرنسي','الدوري-الفرنسي',NULL,1),
(6,'كرة عربية','كرة-عربية',NULL,NULL);
