INSERT INTO `posts` VALUES
(1,'ريال مدريد يوجه تهديدا مباشرا لمبابي','ريال-مدريد-يوجه-تهديدا-مباشرا-لمبابي','https://www.kooora.com/?n=1251794','<p>وجه ريال مدريد تهديدا للفرنسي كيليان مبابي، نجم باريس سان جيرمان، بشأن مفاوضات تمديد عقده في \"حديقة الأمراء\".<br><br>وزعمت تقارير مؤخرًا(...)','<p>وجه ريال مدريد تهديدا للفرنسي كيليان مبابي، نجم باريس سان جيرمان، بشأن مفاوضات تمديد عقده في \"حديقة الأمراء\".<br><br>وزعمت تقارير مؤخرًا بأن سان جيرمان عرض على مبابي تفعيل بند التمديد حتى 2025 مقابل الحصول على مكافأة ولاء إضافية، مع وضع بند خاص يسمح له بالرحيل في 2024 مقابل 200 مليون يورو، ما يفتح الباب أمام انتقاله إلى ريال مدريد دون موافقة باريس.<br><br>ووفقا لشبكة \"<strong>ديفنسا سنترال</strong>\" الإسبانية، تجري فايزة العماري، والدة ووكيلة مبابي، مفاوضات مع سان جيرمان الآن لإيجاد أفضل حل لجميع الأطراف.<br><br>ويبقى ريال مدريد متابعًا للأحداث فقط، مع الحفاظ على موقفه.<br><br>وكشفت الشبكة الإسبانية أن مسؤولي ريال مدريد أبلغوا فايزة العماري:&nbsp;\"إذا مدد مبابي عقده في باريس.. فقد انتهى الأمر\".<br><br>وذكرت \"<strong>ديفنسا سنترال</strong>\" أن&nbsp;الأسبوع المقبل سيكون حاسمًا في مستقبل نجم باريس سان جيرمان.<br><br>وأشارت إلى أن&nbsp;مبابي حتى الآن مصمم على عدم تمديد عقده، لكنه يواجه ضغوطًا قوية، كما أن العماري تعرف نوايا ريال مدريد، وأن هذه الفرصة الأخيرة لانضمام نجلها إلى \"سانتياجو برنابيو\".<br>&nbsp;</p><figure class=\"media\"><oembed url=\"https://www.youtube.com/watch?v=H08tGjXNHO4\"></oembed></figure>','/uploads/2023/07/qAr3bFZqbu.jpeg',1,'published',189,1,2,'2023-07-03 15:06:15','2023-09-08 12:42:05'),
(2,'مفاجأة.. برشلونة مدين لميسي حتى 2025','مفاجأة..-برشلونة-مدين-لميسي-حتى-2025','https://www.kooora.com/?n=1251801','<p>كشف خوان لابورتا، رئيس برشلونة، عن مفاجأة بشأن علاقة البارسا الاقتصادية مع ليونيل ميسي، أسطورة النادي والمنضم حديثا إلى إنتر(...)','<p>كشف خوان لابورتا، رئيس برشلونة، عن مفاجأة بشأن علاقة البارسا الاقتصادية مع ليونيل ميسي، أسطورة النادي والمنضم حديثا إلى إنتر ميامي.<br><br>وقال لابورتا، في تصريحات أبرزتها صحيفة \"<strong>سبورت</strong>\" الإسبانية:&nbsp;\"أفهم لماذا اختار ميسي الانتقال إلى ميامي. كان لدينا اتفاق مع رابطة الليجا بأننا سنخصص جزءًا من الموارد التي نمتلكها لصفقة ميسي\".<br><br>وأضاف:&nbsp;\"كانت هذه النقطة مدرجة ضمن خطة الجدوى المالية الخاصة بنا. أخبرنا خورخي ميسي (والد البرغوث) بهذا الأمر، وقال إن ليو قضى عامًا صعبًا في باريس ويريد تقليل الضغط الذي يشعر به.. كان اللاعب سيواصل المعاناة من&nbsp;الضغط إذا اختار برشلونة\".<br><br>وتابع:&nbsp;\"فهمت قرار ميسي وأتمنى له كل التوفيق، وسنبدأ التحضير لوداعه الكبير بمناسبة مرور 125 عامًا على تأسيس النادي، وسيكون من المثالي العودة إلى ملعب كامب نو في ذلك الوقت\".<br><br>وسئل لابورتا، إذا كان برشلونة مدينا لميسي حتى الآن، وأجاب: \"هناك تأجيل لرواتب ميسي بالفعل تم الاتفاق عليها مع الإدارة السابقة، ونتج عن ذلك مدفوعات معلقة للبرغوث حتى عام 2025.. إننا ندفعها بانتظام\".<br><br>|||2|||</p>','/uploads/2023/07/5uUsndQyTD.jpeg',1,'published',27,1,2,'2023-07-03 15:06:15','2023-09-08 12:42:07'),
