(8,'مسؤول في لايبزيغ يؤكد مفاوضات سيتي وغفارديول','مسؤول-في-لايبزيغ-يؤكد-مفاوضات-سيتي-وغفارديول','https://www.alarabiya.net/sport/international-sport/2023/07/03/%D9%85%D8%B3%D8%A4%D9%88%D9%84-%D9%81%D9%8A-%D9%84%D8%A7%D9%8A%D8%A8%D8%B2%D9%8A%D8%BA-%D9%8A%D8%A4%D9%83%D8%AF-%D9%85%D9%81%D8%A7%D9%88%D8%B6%D8%A7%D8%AA-%D8%B3%D9%8A%D8%AA%D9%8A-%D9%88%D8%BA%D9%81%D8%A7%D8%B1%D8%AF%D9%8A%D9%88%D9%84','\n أكد ماكس إيبرل عضو مجلس إدارة نادي لايبزيغ الألماني لكرة القدم للشؤون الرياضية أن جوسكو غفارديول يريد الرحيل لمانشستر سيتي(...)','\n    أكد ماكس إيبرل عضو مجلس إدارة نادي لايبزيغ الألماني لكرة القدم للشؤون الرياضية أن جوسكو غفارديول يريد الرحيل لمانشستر سيتي الإنجليزي، مشيراً إلى أن النادي دخل في مفاوضات مع بطل دوري أبطال أوروبا.وقال إيبرل لصحيفة \"لايبتسيغر فولكس تسايتونغ\" يوم الاثنين غفارديول ومستشاروه أبلغونا برغبته في الانتقال لمانشستر سيتي. نحن في مفاوضات مع مانشستر. لا يوجد ما يقال أكثر من ذلك في هذه اللحظة.وجذب غفارديول (20 عاماً) أنظار الأندية الأوروبية الكبرى بأدائه المذهل مع المنتخب الكرواتي في بطولة كأس العالم التي أقيمت العام الماضي.وسينضم غفارديول إلى دومينيك سوبوسلاي المنتقل لليفربول مقابل 70 مليون يورو، وكريستوفر نكونكو، الذي انتقل إلى تشيلسي مقابل 60 مليون يورو، وكونارد لايمر الذي انتقل إلى بايرن ميونخ في صفقة انتقال حر.وأنهى لايبزيغ الموسم الماضي في المركز الثالث بالدوري الألماني، ليتأهل لدوري أبطال أوروبا، كما حصد لقب كأس ألمانيا للمرة الثانية على التوالي. \n','/uploads/2023/07/MwNNTiesRz.jpeg',0,'published',10,2,1,'2023-07-03 15:17:02','2023-09-05 14:08:16'),
(9,'الغاني بواتينغ يحدد مستقبله خلال أسبوعين','الغاني-بواتينغ-يحدد-مستقبله-خلال-أسبوعين','https://www.alarabiya.net/sport/international-sport/2023/07/03/%D8%A7%D9%84%D8%BA%D8%A7%D9%86%D9%8A-%D8%A8%D9%88%D8%A7%D8%AA%D9%8A%D9%86%D8%BA-%D9%8A%D8%AD%D8%AF%D8%AF-%D9%85%D8%B3%D8%AA%D9%82%D8%A8%D9%84%D9%87-%D8%AE%D9%84%D8%A7%D9%84-%D8%A3%D8%B3%D8%A8%D9%88%D8%B9%D9%8A%D9%86','<p>يخطط كيفين برينس بواتينغ خلال الأسبوعين المقبلين لاتخاذ قراره النهائي فيما يتعلق بمواصلة مسيرته كلاعب أو الاعتزال، وذلك عقب نهاية(...)','<p>يخطط كيفين برينس بواتينغ خلال الأسبوعين المقبلين لاتخاذ قراره النهائي فيما يتعلق بمواصلة مسيرته كلاعب أو الاعتزال، وذلك عقب نهاية تعاقده مع فريق هيرتا برلين، الذي هبط من دوري الدرجة الأولى الألماني لكرة القدم.وبدأ بواتينج، المولود في برلين، مسيرته الاحترافية في 2005 في هيرتا برلين وعاد للفريق في عام 2021 – بعد أن لعب لعدة أندية منها توتنهام الإنجليزي وميلان وفيورنتينا الإيطاليين وبرشلونة الإسباني، وشالكه وآينتراخت فرانكفورت الألمانيين، لكن اللاعب البالغ من العمر (36 عاماً) نادراً ما لعب الموسم الماضي بسبب الإصابات.وقال بواتينج في حدث قبل انطلاق منافسات يورو 2024 في ألمانيا، حيث أنه يعمل كسفير لبرلين إنه سيعلن عن قراره خلال الأسبوعين المقبلين، وأضاف: يجب أن أرى ما هو الأفضل بالنسبة لي، ما الذي يمكن لجسدي أن يقدمه. مازلت في مرحلة حيث أفكر كيف ستسير الأمور.وواصل: كانت أسابيع وأشهر صعبة بعد الهبوط. لذلك قلت لجميع الجهات أنني بحاجة للراحة، إجازة قصيرة. ولكن القرار سأتخذه خلال الأسبوعين المقبلين، وبعد ذلك سأعلن عنه.</p>','/uploads/2023/07/UFOxkOYSFj.jpeg',1,'published',15,2,1,'2023-07-03 15:17:02','2023-09-04 15:07:36'),
(10,'إيقاف لاعب بالميراس أربعة أشهر بسبب العنصرية','إيقاف-لاعب-بالميراس-أربعة-أشهر-بسبب-العنصرية','https://www.alarabiya.net/sport/international-sport/2023/07/03/%D8%A7%D9%8A%D9%82%D8%A7%D9%81-%D9%84%D8%A7%D8%B9%D8%A8-%D8%A8%D8%A7%D9%84%D9%85%D9%8A%D8%B1%D8%A7%D8%B3-%D8%A3%D8%B1%D8%A8%D8%B9%D8%A9-%D8%A3%D8%B4%D9%87%D8%B1-%D8%A8%D8%B3%D8%A8%D8%A8-%D8%A7%D9%84%D8%B9%D9%86%D8%B5%D8%B1%D9%8A%D8%A9','\n أوقف اتحاد أميركا الجنوبية لكرة القدم (الكونميبول) برونو تاباتا لاعب بالميراس لأربعة أشهر بسبب واقعة تمييز عنصري خلال فوز فريقه(...)','\n    أوقف اتحاد أميركا الجنوبية لكرة القدم (الكونميبول) برونو تاباتا لاعب بالميراس لأربعة أشهر بسبب واقعة تمييز عنصري خلال فوز فريقه 3-صفر على سيرو بورتينو القادم من باراغواي في كأس كوبا ليبرتادوريس، لكن لاعب الوسط قال إنه كان الضحية وسيطعن فريقه على القرار.ولفت تاباتا ومجموعة من بدلاء بالميراس النظر إلى الهتافات العنصرية من جماهير سيرو بورتينو خلال المباراة التي أقيمت في مايو.لكن لجنة الانضباط بالكونميبول عاقبت اللاعب البرازيلي بسبب تصرف غير رياضي. وسيطعن بالميراس على القرار، وجمع عدة فيديوهات لتقديمها مع الطعن.وقال تاباتا في فيديو إلى \"الكونميبول\": اتهمني سيرو بورتينو بتوجيه إشارات عنصرية إلى جماهيره في المباراة التي جمعتنا وهي أفعال لم أرتكبها. ما حدث هو أنني سمعت الجماهير تهتف ‭\'‬قرود‭\'‬ تجاه اللاعبين على أرض الملعب. لا نتحدث بالإسبانية ولم نفهم ما يجري. سألت أحد الجماهير فقد أردت معرفة ما هو الهتاف وأبلغني أنهم يصفون اللاعبين بالقرود.ونشرت مجلة \"غلوبر جي\" فيديو لأحد جماهير سيرو بورتينو وهو يصف لاعبي بالميراس بالقرود بالإضافة إلى هتافات مسيئة أخرى.وقرر \"الكونميبول\" تغريم سيرو بورتينو 100 ألف دولار كما عاقبه بغلق جزئي للمدرج الشمالي الأسفل في مباراته المقبلة مع إجباره على وضع لافتة \"أوقفوا التمييز العنصري\". \n','/uploads/2023/07/BwgiE4mjoM.jpeg',0,'published',2,2,1,'2023-07-03 15:17:02','2023-08-24 22:03:37'),
(11,'جيسوس.. وبخ كويار وميشائيل ولاحق ماريغا','جيسوس..-وبخ-كويار-وميشائيل-ولاحق-ماريغا','https://www.alarabiya.net/sport/saudi-sport/2023/07/02/%D8%AC%D9%8A%D8%B3%D9%88%D8%B3-%D9%88%D8%A8%D8%AE-%D9%83%D9%88%D9%8A%D8%A7%D8%B1-%D9%88%D9%85%D9%8A%D8%B4%D8%A7%D8%A6%D9%8A%D9%84-%D9%88%D9%84%D8%A7%D8%AD%D9%82-%D9%85%D8%A7%D8%B1%D9%8A%D8%BA%D8%A7-','\n 1595 يوما كانت الفارق ما بين بيان إقالة جورجي جيسوس من تدريب الهلال وعودته مجدداً إلى النادي السعودي، درب خلالها(...)','\n    1595 يوما كانت الفارق ما بين بيان إقالة جورجي جيسوس من تدريب الهلال وعودته مجدداً إلى النادي السعودي، درب خلالها البرتغالي فلامنغو البرازيلي وبنفيكا البرتغالي إضافة إلى فنربخشه التركي، ليحقق خمسة ألقاب.وأعلن الهلال، يوم السبت، عودة مدربه السابق البالغ من العمر \"68 عاما\" لقيادة الفريق الأول لكرة القدم وذلك بعقد يمتد لغاية نهاية موسم 2023-2024، بعد أن قضى قرابة الـ 6 أشهر فقط في تجربته الأولى.          جيسوس مع رئيس الهلال خلال إعلان عودة المدرب البرتغالي  غادر جيسوس النادي السعودي أواخر يناير 2019، بعدما تمت إقالته وتعيين الكرواتي زوران ماميتش بدلا عنه.واستطاع جيسوس تحقيق لقب السوبر على كأس الهيئة العامة للرياضة في مباراته الأولى مع الأزرق على حساب اتحاد جدة، كما بلغ ربع نهائي كأس الملك، وذات الدور في كأس زايد للأندية العربية الأبطال، وغادر الفريق وهو متصدرا للدوري السعودي برصيد 37 نقطة وبفارق 3 نقاط عن ملاحقه النصر، قبل أن يظفر الأخير باللقب نهاية الموسم.ودرب جورجي جيسوس الهلال في 23 مباراة بمختلف البطولات، فاز في 18 منها، وتعادل 4 مرات مقابل خسارة وحيدة كانت أمام الحزم.رحلة فلامنغوفي يونيو 2019، قبل جورجي خوض تجربة جديدة في أميركا الجنوبية، بعدما قدم له فلامنغو البرازيلي عرضا لقيادة الفريق الشهير والمعروف بشعبيته الكبيرة، ليقود الفريق في 60 مباراة شهدت 46 فوزا و8 تعادلات و6 هزائم، استقبلت شباك فريقه 54 هدفا مقابل تسجيل 140 هدفا لمصلحة الفريق البرازيلي العريق.          لاعبو فلامنغو مع جيسوس  حقق جيسوس لفلامنغو لقب الدوري البرازيلي وكأس ليبرتادوريس والسوبر البرازيلي وكأس سوداميركانا، ونال وصافة كأس العالم للأندية في 2019.خلال تلك الفترة، واجه جيسوس فريقه الهلال في مباراة واحدة، كانت ضمن نصف نهائي كأس العالم للأندية 2019، قاد فلامنغو للفوز على النادي السعودي بثلاثية لهدف وبلوغ المباراة النهائية التي خسرها بهدف دون مقابل أمام ليفربول.استقاله وإقالةعلى الرغم من كافة النجاحات التي حققها، قدم جيسوس استقالته \"بناءً على قرار شخصي\" من تدريب فلامنغو في يوليو 2020، وأعلن عودته إلى تدريب بنفيكا البرتغالي، وهو الفريق الذي سبق وأشرف عليه لمدة 6 مواسم، توج معه بالدوري البرتغالي في 3 مناسبات وكأس البرتغال وكأس الرابطة المحلية \"5 مرات\"، مع تحقيق المركز الثاني مرتين في مسابقة الدوري الأوروبي 2013 و 2014.          جيسوس مع لاعب بنفيكا  ولم تكن فترته جيسوس مع النادي البرتغالي مثل السابقة، إذ أعلن بنفيكا في ديسمبر 2021 انفصاله عن جيسوس بسبب النتائج السيئة وخلافه مع اللاعبين، بعد 83 مباراة شهدت 14 هزيمة و16 تعادلا، وتحقيق الفوز في 53 مباراة.وجاءت إقالة المدرب على الرغم من نجاحه في قيادة بنفيكا إلى الدور ثمن النهائي لمسابقة دوري أبطال أوروبا خلف بايرن ميونيخ الألماني وعلى حساب برشلونة الإسباني، إلا أنه دفع ثمن خروج بنفيكا من الدور الرابع لمسابقة الكأس المحلية بخسارته المذلة أمام غريمه التقليدي بورتو بثلاثية نظيفة، بالإضافة إلى خسارته ديربي لشبونة على أرضه أمام جاره سبورتينغ في الدوري.وذكرت وسائل إعلام برتغالية أن جيسوس دخل في نزاع مع أحد أبرز نجوم الفريق وهو بيتزي.مغامرة ثالثةقرر جورجي خوض مغامرة ثالثة \"بعد الهلال وفلامنغو\" خارج بلاده في يوليو 2022، عندما وافق على تدريب فنربخشه التركي بعقد لمدة موسم واحد.          البرتغالي حقق الكأس مع فنربخشه  حقق البرتغالي كأس تركيا خلال الموسم مع فنربخشه، الذي دربه في 52 مباراة، شهدت 35 انتصارا و10 تعادلات إضافة إلى 7 هزائم، وحل فريقه وصيفا في الدوري خلف غلطة سراي.وودع جيسوس النادي في مؤتمر صحافي بعد التتويج بلقب الكأس أمام باشاك شهير، قائلا: بدءاً من اليوم، لم أعد مدرباً لفنربخشة.لم ينس الهلاللم يغادر الهلال أذهان المدرب البرتغالي، فبعد أن كشف في تصريحات لبرنامج \"في المرمى\" أنه تفاجأ بقرار إقالته من تدريب الفريق الأزرق، وأعرب عن عدم رضاه من الطريقة التي تمت إقالته عبرها، كما كشف أنه يتابع مباريات الهلال عبر الإنترنت من البرتغال.وقبل مونديال الأندية 2019، خرج بتصريح مثير عندما قال إنه لا يوجد فارق كبير على صعيد المستوى بين الهلال السعودي وليفربول الإنجليزي، وحذر من صعوبة مواجهة النادي السعودي في كأس العالم للأندية.ألقاب ومونديال الأنديةامتدح كارلوس إدواردو، لاعب الهلال السابق، المدرب جورجي جيسوس، كاشفا عن أنه ساهم في تغيير عدة مفاهيم في الهلال.          إدواردو وجيسوس  وبعد مغادرة جيسوس للهلال، حقق صاحب اللون الأزرق عدة ألقاب محلية أبرزها الفوز بدوري أبطال آسيا مرتين في 2019 و 2021 وتحقيق لقب الدوري في 3 نسخ متتالية إضافة إلى ألقاب محلية أخرى، كما شارك في مونديال الأندية ثلاث مرات.إعجاب وعقابيعود جيسوس إلى الهلال بعد أن شهد النادي عدة تغييرات على مستوى اللاعبين الأجانب، إلا أن بعضهم سبق وأشرف البرتغالي على تدريبهم مثل الكولومبي كويار والبرازيلي ميشائيل، وهناك أسماء يعرفها سبق وأراد ضمها إلى الفرق التي دربها مثل موسى ماريغا. كما بدأ الهلال تعاقداته الصيفة بضم مواطنه البرتغالي روبن نيفيز والمدافع السنغالي كوليبالي، ولم يتضح مستقبل بعض المحترفين الأجانب بما فيهم لاعب الوسط الكولومبي.ولم يخف جورجي إعجابه بالجناح ماريغا، وقال في تصريحات عام 2018: كنت أريده بالفعل قبل انضمامه إلى بورتو، إنه لاعب رائع، لطالما أردته.كما سيكون على موعد جديد مع لاعبه الكولومبي السابق غوستافو كويار، حال استمرار الأخير، الذي دربه في فلامنغو قبل رحيل الكولومبي إلى الهلال، وكان جيسوس توعد كويار بعقوبة صارمة عقب تمرده على الفريق وغيابه عن المباريات، بعدما تعلل كويار بحدوث مشاكل عائلية مع زوجته، في حين ذهبت تقارير صحافية برازيلية إلى أن اللاعب يرغب في الرحيل، وذلك قبل انضمامه إلى الهلال.          كويار ويظهر في الصورة جورجي  وأشارت \"ماركا\" إلى أن جيسوس غير راض من موقف كويار وانتقده بشده، وقال: سيتعين على كويار أن يتحمل عواقب الموقف الذي اتخذه. لقد اتخذ مجلس إدارة النادي قرار إيقافه، والنادي أهم من اللاعب، وعندما يعتقد أحد اللاعبين أنه أعلى من الفريق والنادي، فإنه سيواجه المشاكل.توبيخيملك ميشائيل 16 مباراة مع جيسوس في فلامنغو، سجل 3 أهداف ولعب 3 تمريرات حاسمة، ومن الممكن يخوض معه تجربة جديدة أيضا حال قرر الاعتماد عليه في الموسم المقبل.وتعاقد فلامنغو مع ميشائيل بتوصية من جيسوس، إلا أنه كان يواجه صعوبات في حياته، وتعرض اللاعب لمشاكل نفسية، وقال موقع \"تورسيدوريس\" إن ميشائيل فكر في الانتحار، قبل أن يحصل على الدعم من اللاعبين والعاملين في النادي، واعترف أيضا بمساعدة جيسوس له من أجل التغلب على الاكتئاب.          ميشائيل مع جيسوس  وكشف ميشائيل في مقابلة سابقة عن تجربته مع جيسوس، قائلا: ساعدني جورجي، في أحد الأيام لم أكن في أفضل حالات تركيزي، طلبت منه إنهاء عقدي، كنت أبكي، لم أستطع حتى التحدث بشكل صحيح، لكنني قلت أنني بحاجة إلى المساعدة، أريد حقا التطور، لكنني لم أستطع النوم بمفردي بسبب متلازمة الهلع، فقال لي: لن أتخلى عنك، إذا ذهبت إلى المنزل هل ستنام جيدا؟ نظرت إليه وسقطت الدموع من عيني، ثم قال لي إنه سيشركني في الشوط الثاني خلال مباراة اليوم التالي.وأضاف: أمام فلومينيسي دخلت وسجلت هدفا، ربت على وجهي، وقال\"أنت رجل اللقاء\"، ثم سألني عن حالتي، فقلت إنني بخير، لكن المشكلة كانت في النوم حقا.وأردف ميشائيل: في إحدى المباريات، قمت بالسيطرة على الكرة بطريقة فنية، قال لي\" إذا كررتها مرة أخرى سأعيدك إلى ناديك السابق ولن تلعب معي مرة أخرى\"، كانت أسوأ من توجيه لكمة لي.ووصف ميشائيل المدرب البرتغالي بالذكي، وقال عنه: إنه ذكي للغاية، عندما وصلت وجدته يتدرب معنا في الصالة الرياضية، كان يقول \"عمري 60 عاما وأمارس التمارين البدنية\".كنو الأبرزيعتبر لاعب خط الوسط محمد كنو أحد أبرز اللاعبين الذين جذب أنظار جيسوس، وأكثر اللاعبين خوضا للمباريات معه في الهلال \"25 مباراة\" بجانب كارلوس إدواردو.          كنو في مباراة بين الهلال والنصر  كما أبدى جيسوس إعجابه الشديد بقدرات محمد كنو بعد رحيله عن الهلال، ووصفه باللاعب القوي والمميز في السعودية وأيضا أوروبا، وزاد في تصريحات لـ \"في المرمى\": عطيف أيضا لاعب جيد ولكني بدلت موقع كنو مع عطيف، وعندما أصيب عطيف لعب مكانه كنو.وكشف في تصريحاته السابقة على أنه سيختار ثلاثة لاعبين من الهلال في حال تعاقده مع أي ناد لتدريبه، وهم سالم الدوسري وسلمان الفرج ومحمد كنو. \n','/uploads/2023/07/tLY3qG06Ye.jpeg',0,'published',3,2,1,'2023-07-03 15:17:02','2023-08-24 22:04:18'),
(12,'التونسي بن رمضان ينتقل إلى بطل الدوري المجري','التونسي-بن-رمضان-ينتقل-إلى-بطل-الدوري-المجري','https://www.alarabiya.net/sport/arab-sport/2023/07/02/%D8%A7%D9%84%D8%AA%D9%88%D9%86%D8%B3%D9%8A-%D8%A8%D9%86-%D8%B1%D9%85%D8%B6%D8%A7%D9%86-%D9%8A%D9%86%D8%AA%D9%82%D9%84-%D8%A7%D9%84%D9%89-%D8%A8%D8%B7%D9%84-%D8%A7%D9%84%D8%AF%D9%88%D8%B1%D9%8A-%D8%A7%D9%84%D9%85%D8%AC%D8%B1%D9%8A','\n قال فرينسفاروش بطل الدوري المجري لكرة القدم إنه تعاقد مع لاعب الوسط التونسي محمد علي بن رمضان في صفقة انتقال(...)','\n    قال فرينسفاروش بطل الدوري المجري لكرة القدم إنه تعاقد مع لاعب الوسط التونسي محمد علي بن رمضان في صفقة انتقال مجاني يوم الأحد.ورحل بن رمضان بعد انتهاء عقده مع الترجي التونسي ووقع عقدا لثلاثة مواسم مع فرينسفاروش.ولعب بن رمضان (23 عاما) 143 مباراة مع الترجي، سجل خلالها 34 هدفا وصنع ستة أهداف، كما أحرز هدفا واحدا في 27 مباراة مع المنتخب التونسي.وتوج بن رمضان مع الترجي بالدوري التونسي في خمس مناسبات، بالإضافة إلى لقب واحد في كل من كأس تونس ودوري أبطال إفريقيا. \n','/uploads/2023/07/o9LlGoCd60.jpeg',0,'published',5,2,1,'2023-07-03 15:17:02','2023-08-24 22:07:26'),
(13,'باريس ينفصل عن مدربه الفرنسي غالتييه','باريس-ينفصل-عن-مدربه-الفرنسي-غالتييه','https://www.alarabiya.net/sport/international-sport/2023/07/05/%D8%A8%D8%A7%D8%B1%D9%8A%D8%B3-%D9%8A%D9%86%D9%81%D8%B5%D9%84-%D8%B9%D9%86-%D9%85%D8%AF%D8%B1%D8%A8%D9%87-%D8%A7%D9%84%D9%81%D8%B1%D9%86%D8%B3%D9%8A-%D8%BA%D8%A7%D9%84%D8%AA%D9%8A%D9%8A%D9%87','<p>انفصل باريس سان جيرمان بطل دوري الدرجة الأولى الفرنسي لكرة القدم يوم الأربعاء عن مدربه كريستوف غالتييه لُيسدل الستار على(...)','<p>انفصل باريس سان جيرمان بطل دوري الدرجة الأولى الفرنسي لكرة القدم يوم الأربعاء عن مدربه كريستوف غالتييه لُيسدل الستار على موسم مضطرب تحت قيادة المدرب الذي يتبقى عام على نهاية عقده.ووقع غالتييه عقدا لمدة عامين عندما وصل إلى استاد \"بارك دي برينس\" قبل موسم 2022-2023، لكن رغم قيادة الفريق للانفراد بالرقم القياسي للفوز بالدوري المحلي للمرة 11 فإن الفشل في دوري أبطال أوروبا عاد ليطارده.ومن المتوقع أن يعلن نادي العاصمة الفرنسية يوم الأربعاء تعاقده مع المدرب الإسباني لويس إنريكي الذي ترك منصبه كمدرب لمنتخب بلاده عقب الخروج من ثمن نهائي كأس العالم الأخيرة بركلات الترجيح أمام المغرب.</p>','/uploads/2023/07/tT9DqD0yac.jpeg',1,'published',31,2,1,'2023-07-05 15:07:41','2023-09-07 14:23:40'),
(14,'برشلونة يتعاقد مع المدافع الإسباني إينيغو مارتينيز','برشلونة-يتعاقد-مع-المدافع-الإسباني-إينيغو-مارتينيز','https://www.alarabiya.net/sport/international-sport/2023/07/05/%D8%A8%D8%B1%D8%B4%D9%84%D9%88%D9%86%D8%A9-%D9%8A%D8%AA%D8%B9%D8%A7%D9%82%D8%AF-%D9%85%D8%B9-%D8%A7%D9%84%D9%85%D8%AF%D8%A7%D9%81%D8%B9-%D8%A7%D9%84%D8%A7%D8%B3%D8%A8%D8%A7%D9%86%D9%8A-%D8%A7%D9%8A%D9%86%D9%8A%D8%BA%D9%88-%D9%85%D8%A7%D8%B1%D8%AA%D9%8A%D9%86%D9%8A%D8%B2','<p>أعلن برشلونة بطل الدوري الإسباني لكرة القدم يوم الأربعاء تعاقده مع المدافع إينيغو مارتينيز قادماً من صفوف أتلتيك بلباو في(...)','<p>أعلن برشلونة بطل الدوري الإسباني لكرة القدم يوم الأربعاء تعاقده مع المدافع إينيغو مارتينيز قادماً من صفوف أتلتيك بلباو في صفقة انتقال حر.وأشار النادي الكاتالوني إلى أن المدافع الدولي الإسباني (32 عاماً) وافق على توقيع عقد مدته عامان وبشرط جزائي قدره 400 مليون يورو.ولعب مارتينيز 357 مباراة دورية مع أتلتيك بلباو وريال سوسييداد سجل خلالها 22 هدفاً.وبات مارتينيز ثاني صفقات برشلونة في فترة الصيف الحالي بعد ضم الألماني إلكاي غندوغان قائد مانشستر سيتي بعقد يمتد لـ3 أعوام.</p>','/uploads/2023/07/Yxzbll9kgg.jpeg',1,'published',11,2,1,'2023-07-05 15:07:41','2023-09-08 12:42:16'),
(15,'توخيل يزور كين في منزله لإقناعه بالانتقال إلى بايرن','توخيل-يزور-كين-في-منزله-لإقناعه-بالانتقال-إلى-بايرن','https://www.alarabiya.net/sport/international-sport/2023/07/05/%D8%AA%D9%88%D8%AE%D9%8A%D9%84-%D9%8A%D8%B2%D9%88%D8%B1-%D9%83%D9%8A%D9%86-%D9%81%D9%8A-%D9%85%D9%86%D8%B2%D9%84%D9%87-%D9%84%D8%A7%D9%82%D9%86%D8%A7%D8%B9%D9%87-%D8%A8%D8%A7%D9%84%D8%A7%D9%86%D8%AA%D9%82%D8%A7%D9%84-%D8%A7%D9%84%D9%89-%D8%A8%D8%A7%D9%8A%D8%B1%D9%86','كشف تقرير إخباري يوم الأربعاء أن توماس توخيل المدير الفني لفريق بايرن ميونخ الألماني لكرة القدم زار هاري كين قائد(...)','\n                        \n                            \n                        \n                        كشف تقرير إخباري يوم الأربعاء أن توماس توخيل المدير الفني لفريق بايرن ميونخ الألماني لكرة القدم زار هاري كين قائد فريق توتنهام الإنجليزي والمنتخب الإنجليزي، بهدف إقناعه بالانضمام إلى بايرن في الصيف.وذكرت صحيفة \"شبورت بيلد\" الأسبوعية في عددها الصادر يوم الأربعاء أن توخيل وحسن صالح حميديتش اجتمعا مع هاري كين في منتصف مايو الماضي في منزله في العاصمة البريطانية لندن، وكان اللاعب معجباً بفكرة الانتقال إلى بافاريا، أملاً بالفوز ببطولة دوري أبطال أوروبا.وينوي بايرن ميونخ تجهيز عرض ثان لهاري كين بعد أن تقدم بعرض سابق قيمته نحو 70 مليون يورو قوبل بالرفض، وذلك قبل عام من نهاية عقد المهاجم الإنجليزي الدولي.ويتطلع بايرن ميونخ المتوج ببطولة الدوري الألماني للموسم الحادي عشر على التوالي إلى التعاقد مع مهاجم جديد لتعويض روبرت ليفاندوفسكي الذي انتقل إلى برشلونة صيف العام الماضي.\n                \n            ','/uploads/2023/07/pcLG4gdNvc.jpeg',0,'published',4,2,1,'2023-07-05 15:07:41','2023-09-04 02:13:38'),
(16,'البرازيل تعين مدرباً مؤقتاً لحين وصول أنشيلوتي','البرازيل-تعين-مدرباً-مؤقتاً-لحين-وصول-أنشيلوتي','https://www.alarabiya.net/sport/international-sport/2023/07/05/%D8%A7%D9%84%D8%A8%D8%B1%D8%A7%D8%B2%D9%8A%D9%84-%D8%AA%D8%B9%D9%8A%D9%86-%D9%85%D8%AF%D8%B1%D8%A8%D8%A7%D9%8B-%D9%85%D8%A4%D9%82%D8%AA%D8%A7%D9%8B-%D9%84%D8%AD%D9%8A%D9%86-%D9%88%D8%B5%D9%88%D9%84-%D8%A3%D9%86%D8%B4%D9%8A%D9%84%D9%88%D8%AA%D9%8A','أعلن الاتحاد البرازيلي لكرة القدم يوم الأربعاء تعيين المدرب فيرناندو دينيز مديرا فنيا مؤقتا للمنتخب البرازيلي بعقد لمدة عام واحد(...)','\n                        \n                            \n                        \n                        أعلن الاتحاد البرازيلي لكرة القدم يوم الأربعاء تعيين المدرب فيرناندو دينيز مديرا فنيا مؤقتا للمنتخب البرازيلي بعقد لمدة عام واحد فقط لحين انتقال الإيطالي كارلو أنشيلوتي المدير الفني الحالي لريال مدريد الإسباني إلى تدريب المنتخب البرازيلي في منتصف العام المقبل.وأوضح إدنالدو رودريغيز رئيس الاتحاد البرازيلي للعبة لدى الإعلان عن تعيين دينيز أن أنشيلوتي سيكون مديرا فنيا للفريق في بطولة كوبا أميركا 2024.ويتولى دينيز قيادة المنتخب البرازيلي بشكل مؤقت إلى جانب عمله مديرا فنيا لفريق فلومينيزي البرازيل على أن تكون فترة عمله مع المنتخب البرازيلي في الأشهر المقبلة قاصرة على فترات ارتباط الفريق بتصفيات قارة أميركا الجنوبية المؤهلة لكأس العالم 2026.وقال رودريغيز في المؤتمر الصحفي للإعلان عن تعيين دينيز بمقر الاتحاد البرازيلي في ريو دي جانيرو:\"لدينا العديد من المدربين الرائعين في البرازيل. دينيز أحدهم. أدركت عمله المبتكر وفلسفته مع الأندية التي تولى تدريبها، أحب بالفعل نزعاته الخططية وتجديداته. ولهذا، فإنه مدرب يتشابه مع المدرب أنشيلوتي الذي سيتولى المسؤولية في كوبا أميركا، فلديهما نفس النزعة.\n                \n            ','/uploads/2023/07/97JLgyyDHu.jpeg',0,'published',2,2,1,'2023-07-05 15:07:41','2023-08-24 22:02:47'),
(17,'رونالدو: الدوري السعودي أفضل من الأمريكي','رونالدو:-الدوري-السعودي-أفضل-من-الأمريكي','https://www.kooora.com/?n=1255277','يرى البرتغالي كريستيانو رونالدو نجم النصر، أن الدوري السعودي أفضل من نظيره الأمريكي.  وانضم رونالدو إلى النصر في الميركاتو الشتوي...','&#1610;&#1585;&#1609; &#1575;&#1604;&#1576;&#1585;&#1578;&#1594;&#1575;&#1604;&#1610; &#1603;&#1585;&#1610;&#1587;&#1578;&#1610;&#1575;&#1606;&#1608; &#1585;&#1608;&#1606;&#1575;&#1604;&#1583;&#1608; &#1606;&#1580;&#1605; &#1575;&#1604;&#1606;&#1589;&#1585;&#1548; &#1571;&#1606; &#1575;&#1604;&#1583;&#1608;&#1585;&#1610; &#1575;&#1604;&#1587;&#1593;&#1608;&#1583;&#1610; &#1571;&#1601;&#1590;&#1604; &#1605;&#1606; &#1606;&#1592;&#1610;&#1585;&#1607; &#1575;&#1604;&#1571;&#1605;&#1585;&#1610;&#1603;&#1610;.<br /><br />&#1608;&#1575;&#1606;&#1590;&#1605; &#1585;&#1608;&#1606;&#1575;&#1604;&#1583;&#1608; &#1573;&#1604;&#1609; &#1575;&#1604;&#1606;&#1589;&#1585; &#1601;&#1610; &#1575;&#1604;&#1605;&#1610;&#1585;&#1603;&#1575;&#1578;&#1608; &#1575;&#1604;&#1588;&#1578;&#1608;&#1610; &#1575;&#1604;&#1605;&#1606;&#1589;&#1585;&#1605;&#1548; &#1576;&#1593;&#1583;&#1605;&#1575; &#1601;&#1587;&#1582; &#1593;&#1602;&#1583;&#1607; &#1605;&#1593; &#1605;&#1575;&#1606;&#1588;&#1587;&#1578;&#1585; &#1610;&#1608;&#1606;&#1575;&#1610;&#1578;&#1583;.<br /><br />&#1608;&#1602;&#1575;&#1604; &#1585;&#1608;&#1606;&#1575;&#1604;&#1583;&#1608;&#1548; &#1582;&#1604;&#1575;&#1604; &#1578;&#1589;&#1585;&#1610;&#1581;&#1575;&#1578; &#1589;&#1581;&#1601;&#1610;&#1577;&#1548; &#1593;&#1602;&#1576; &#1582;&#1587;&#1575;&#1585;&#1577; &#1575;&#1604;&#1606;&#1589;&#1585; &#1575;&#1604;&#1608;&#1583;&#1610;&#1577; &#1590;&#1583; &#1587;&#1610;&#1604;&#1578;&#1575; &#1601;&#1610;&#1580;&#1608; &#1575;&#1604;&#1573;&#1587;&#1576;&#1575;&#1606;&#1610; &#1608;&#1583;&#1610;&#1611;&#1575; &#1576;&#1606;&#1578;&#1610;&#1580;&#1577; (0-5): &quot;&#1575;&#1604;&#1583;&#1608;&#1585;&#1610; &#1575;&#1604;&#1587;&#1593;&#1608;&#1583;&#1610; &#1571;&#160