(18,'اتفاق نهائي بين سان جيرمان وبديل مبابي','اتفاق-نهائي-بين-سان-جيرمان-وبديل-مبابي','https://www.kooora.com/?n=1259719','توصل نادي باريس سان جيرمان، إلى اتفاق نهائي بشأن التعاقد مع مهاجم جديد هذا الصيف، تحسبا للرحيل المحتمل لكيليان مبابي،(...)','&#1578;&#1608;&#1589;&#1604; &#1606;&#1575;&#1583;&#1610; &#1576;&#1575;&#1585;&#1610;&#1587; &#1587;&#1575;&#1606; &#1580;&#1610;&#1585;&#1605;&#1575;&#1606;&#1548; &#1573;&#1604;&#1609; &#1575;&#1578;&#1601;&#1575;&#1602; &#1606;&#1607;&#1575;&#1574;&#1610; &#1576;&#1588;&#1571;&#1606; &#1575;&#1604;&#1578;&#1593;&#1575;&#1602;&#1583; &#1605;&#1593; &#1605;&#1607;&#1575;&#1580;&#1605; &#1580;&#1583;&#1610;&#1583; &#1607;&#1584;&#1575; &#1575;&#1604;&#1589;&#1610;&#1601;&#1548; &#1578;&#1581;&#1587;&#1576;&#1575; &#1604;&#1604;&#1585;&#1581;&#1610;&#1604; &#1575;&#1604;&#1605;&#1581;&#1578;&#1605;&#1604; &#1604;&#1603;&#1610;&#1604;&#1610;&#1575;&#1606; &#1605;&#1576;&#1575;&#1576;&#1610;&#1548; &#1573;&#1604;&#1609; &#1585;&#1610;&#1575;&#1604; &#1605;&#1583;&#1585;&#1610;&#1583;.<br /><br />&#1608;&#1608;&#1601;&#1602;&#1575; &#1604;&#1589;&#1581;&#1610;&#1601;&#1577; &quot;<strong>&#1604;&#1608; &#1576;&#1575;&#1585;&#1610;&#1586;&#1610;&#1575;&#1606;</strong>&quot; &#1575;&#1604;&#1601;&#1585;&#1606;&#1587;&#1610;&#1577;&#1548; &#1578;&#1608;&#1589;&#1604; &#1587;&#1575;&#1606; &#1580;&#1610;&#1585;&#1605;&#1575;&#1606; &#1573;&#1604;&#1609; &#1575;&#1578;&#1601;&#1575;&#1602; &#1606;&#1607;&#1575;&#1574;&#1610; &#1605;&#1593; &#1576;&#1606;&#1601;&#1610;&#1603;&#1575; &#1576;&#1588;&#1571;&#1606; &#1590;&#1605; &#1575;&#1604;&#1576;&#1585;&#1578;&#1594;&#1575;&#1604;&#1610; &#1580;&#1608;&#1606;&#1586;&#1575;&#1604;&#1608; &#1585;&#1575;&#1605;&#1608;&#1587;&#1548; &#1593;&#1604;&#1609; &#1587;&#1576;&#1610;&#1604; &#1575;&#1604;&#1573;&#1593;&#1575;&#1585;&#1577; &#1605;&#1593; &#1573;&#1604;&#1586;&#1575;&#1605;&#1610;&#1577; &#1575;&#1604;&#1588;&#1585;&#1575;&#1569; &#1601;&#1610; &#1575;&#1604;&#1589;&#1610;&#16