&nbsp;&#1585;&#1575;&#1606;&#1583;&#1575;&#1604; &#1603;&#1608;&#1604;&#1608; &#1605;&#1608;&#1575;&#1606;&#1610; &#1605;&#1606; &#1570;&#1610;&#1606;&#1578;&#1585;&#1575;&#1582;&#1578; &#1601;&#1585;&#1575;&#1606;&#1603;&#1601;&#1608;&#1585;&#1578;.<br /><br />|||2|||','/uploads/2023/08/SeUHfWP9aM.jpeg',0,'published',21,1,1,'2023-08-07 15:00:23','2023-09-08 12:42:14'),
(19,'بمشاركة أكبر النجوم.. حفل تدشين عالمي للدوري السعودي','بمشاركة-أكبر-النجوم..-حفل-تدشين-عالمي-للدوري-السعودي','https://www.kooora.com/?n=1259735','<p>تنظِّم رابطة الدوري السعودي للمحترفين، مساء اليوم الاثنين، حفل تدشين دوري روشن السعودي 2023-2024م، بمشاركة عدد من أبرز نجوم الدوري(...)','<p>تنظِّم رابطة الدوري السعودي للمحترفين، مساء اليوم الاثنين، حفل تدشين دوري روشن السعودي 2023-2024م، بمشاركة عدد من أبرز نجوم الدوري المنضمين حديثًا، وذلك في ملعب مدينة الملك عبدالله الرياضية (الجوهرة المشعة).<br><br>وينطلق الحفل عند الساعة التاسعة مساءً، وسط حراك كبير في المشهد الكروي السعودي، مع وجود أبرز نجوم لعبة كرة القدم في العالم ضمن برنامج لاستقطاب نخبة اللاعبين، كواحد من المسارات الثلاثة الأساسية لإستراتيجية التحول في الرابطة، التي أُعلِنَ عنها مُؤَخَّرًا.<br><br>وتهدف إستراتيجية التحول إلى رفع القيمة التسويقية والفنية للدوري، لاحتلال مركز متقدم ضمن أقوى 10 دوريات في العالم.<br><br>وذلك عبر الاهتمام بتطوير العمل الإداري لكرة القدم في الأندية، مع استحداث وحدة متخصصة لهذا الغرض في الرابطة، مستفيدين من أفضل التجارب العالمية المُطَبَّقَةِ في هذا المجال.<br><br>ويشارك 18 فريقًا في منافسات الدوري السعودي للمحترفين، للمرة الأولى ابتداءً من هذا الموسم، الذي سينطلق يوم الجمعة 11 أغسطس/آب 2023م، وستكون هذه النسخة الثانية بمسمى دوري روشن السعودي.</p>','/uploads/2023/08/mv7vefExaz.jpeg',1,'published',11,1,6,'2023-08-07 15:00:23','2023-09-08 06:26:22'),
(27,'خطوة واحدة تؤجل وصول مبابي إلى ريال مدريد','خطوة-واحدة-تؤجل-وصول-مبابي-إلى-ريال-مدريد','https://www.kooora.com/?n=1265850','<p>لا تزال التكهنات مستمرة بشأن قنبلة مدوية، قد تهز سوق الانتقالات الصيفية في الساعات القليلة المقبلة، بشأن إمكانية انتقال كيليان(...)','<p>لا تزال التكهنات مستمرة بشأن قنبلة مدوية، قد تهز سوق الانتقالات الصيفية في الساعات القليلة المقبلة، بشأن إمكانية انتقال كيليان مبابي، نجم باريس سان جيرمان إلى ريال مدريد.<br><br>وواصلت صحيفة \"<strong>سبورت\"&nbsp;</strong>الإسبانية، تأكيداتها بأن هذه الصفقة قد تتم في الساعات الأخيرة من سوق الانتقالات، وتبقى حاليا عالقة على أمر واحد، وهو الاتفاق بين مبابي وبي إس جي على تسوية مديونية مالية.<br><br>أوضحت أن المديونية قيمتها 80 مليون يورو، وتمثل مكافأة التوقيع في عقد مبابي مع بي إس جي، والتي يستحقها لاستمراره مع الفريق لما بعد 31 يوليو/تموز 2023.<br><br>|||2|||<br><br>وأشارت الصحيفة \"هذه المكافأة من الأسباب الرئيسية التي تدفع النجم الفرنسي للبقاء في باريس هذا الصيف، والانضمام إلى ريال مدريد، مجانا، بعد عام\".<br><br>ولفتت \"<strong>سبورت\"&nbsp;</strong>إلى أنه حال صحة التكهنات الأخيرة، فإنه سيتعين على ريال مدريد الاتفاق مع مبابي على كيفية سداد مكافأة توقيعه.<br><br>ورجحت أن صفقة كيليان مبابي، ستكلف خزينة النادي الملكي 250 مليون يورو.</p>','/uploads/2023/08/5IJybVETzb.webp',1,'published',9,1,5,'2023-08-31 17:56:04','2023-09-08 12:42:21'),
(28,'برشلونة يسابق الزمن لإنجاز صفقة من الدوري الأمريكي','برشلونة-يسابق-الزمن-لإنجاز-صفقة-من-الدوري-الأمريكي','https://www.kooora.com/?n=1265820','يواصل برشلونة تحركاته السريعة، قبل ساعات من غلق سوق الانتقالات الصيفية في أوروبا.  وبحسب صحيفة   ذا أثلتيك ...','&#1610;&#1608;&#1575;&#1589;&#1604; &#1576;&#1585;&#1588;&#1604;&#1608;&#1606;&#1577; &#1578;&#1581;&#1585;&#1603;&#1575;&#1578;&#1607; &#1575;&#1604;&#1587;&#1585;&#1610;&#1593;&#1577;&#1548; &#1602;&#1576;&#1604; &#1587;&#1575;&#1593;&#1575;&#1578; &#1605;&#1606; &#1594;&#1604;&#1602; &#1587;&#1608;&#1602; &#1575;&#1604;&#1575;&#1606;&#1578;&#1602;&#1575;&#1604;&#1575;&#1578; &#1575;&#1604;&#1589;&#1610;&#1601;&#1610;&#1577; &#1601;&#1610; &#1571;&#1608;&#1585;&#1608;&#1576;&#1575;.<br /><br />&#1608;&#1576;&#1581;&#1587;&#1576; &#1589;&#1581;&#1610;&#1601;&#1577; &quot;<strong>&#1584;&#1575; &#1571;&#1579;&#1604;&#1578;&#1610;&#1603;</strong>&quot; &#1575;&#1604;&#1576;&#1585;&#1610;&#1591;&#1575;&#1606;&#1610;&#1577;&#1548; &#1601;&#1573;&#1606; &#1576;&#1585;&#1588;&#1604;&#1608;&#1606;&#1577; &#1610;&#1587;&#1578;&#1607;&#1583;&#1601; &#1575;&#1604;&#1578;&#1593;&#1575;&#1602;&#1583; &#1605;&#1593; &#1575;&#1604;&#1605;&#1583;&#1575;&#1601;&#1593; &#1575;&#1604;&#1587;&#1606;&#1594;&#1575;&#1604;&#1610; &#1605;&#1575;&#1605;&#1575;&#1583;&#1608; &#1601;&#1575;&#1604;&#1548; &#1604;&#1575;&#1593;&#1576; &#1604;&#1608;&#1587; &#1571;&#1606;&#1580;&#1604;&#1608;&#1587; &#1575;&#1604;&#1571;&#1605;&#1585;&#1610;&#1603;&#1610;.<br /><br />&#1608;&#1571;&#1588;&#1575;&#1585; &#1575;&#1604;&#1578;&#1602;&#1585;&#1610;&#1585;&#1548; &#1573;&#1604;&#1609; &#1571;&#1606; &#1576;&#1585;&#1588;&#1604;&#1608;&#1606;&#1577; &#1576;&#1575;&#1578; &#1602;&#1585;&#1610;&#1576;&#1575; &#1605;&#1606; &#1575;&#1604;&#1578;&#1608;&#1589;&#1604; &#1604;&#1575;&#1578;&#1601;&#1575;&#1602; &#1604;&#1590;&#1605; &#1601;&#1575;&#1604; &#1575;&#1604;&#1584;&#1610; &#1604;&#1593;&#1576; &#1575;&#1604;&#1605;&#1608;&#1587;&#1605; &#1