 &#1576;&#1588;&#1603;&#1604; &#1606;&#1607;&#1575;&#1574;&#1610;&#1548; &#1602;&#1576;&#1604; &#1571;&#1606; &#1610;&#1578;&#1583;&#1582;&#1604; &#1576;&#1585;&#1588;&#1604;&#1608;&#1606;&#1577; &#1601;&#1610; &#1575;&#1604;&#1589;&#1601;&#1602;&#1577;.<br /><br />&#1608;&#1571;&#1588;&#1575;&#1585;&#1578; &#1573;&#1604;&#1609; &#1571;&#1606; &#1601;&#1575;&#1604; &#1610;&#1601;&#1590;&#1604; &#1582;&#1610;&#1575;&#1585; &#1575;&#1604;&#1604;&#1593;&#1576; &#1604;&#1576;&#1585;&#1588;&#1604;&#1608;&#1606;&#1577;&#1548; &#1608;&#1575;&#1604;&#1603;&#1585;&#1577; &#1575;&#1604;&#1570;&#1606; &#1571;&#1589;&#1576;&#1581;&#1578; &#1601;&#1610; &#1605;&#1604;&#1593;&#1576; &#1573;&#1583;&#1575;&#1585;&#1577; &#1604;&#1608;&#1587; &#1571;&#1606;&#1580;&#1604;&#1608;&#1587; &#1604;&#1604;&#1605;&#1608;&#1575;&#1601;&#1602;&#1577; &#1593;&#1604;&#1609; &#1575;&#1604;&#1589;&#1601;&#1602;&#1577;.','/uploads/2023/08/RPalTQFmPH.webp',0,'published',6,1,1,'2023-08-31 17:57:21','2023-09-08 12:42:18'),
(29,'منعزلة ومترددة.. بطلة \"قبلة \"روبياليس تعيش أصعب فترات حياتها','منعزلة-ومترددة..-بطلة-\"قبلة-\"روبياليس-تعيش-أصعب-فترات-حياتها','https://www.alarabiya.net/sport/2023/08/31/%D9%85%D9%86%D8%B9%D8%B2%D9%84%D8%A9-%D9%88%D9%85%D8%AA%D8%B1%D8%AF%D8%AF%D8%A9-%D8%A8%D8%B7%D9%84%D8%A9-%D9%82%D8%A8%D9%84%D8%A9-%D8%B1%D9%88%D8%A8%D9%8A%D8%A7%D9%84%D9%8A%D8%B3-%D8%AA%D8%B9%D9%8A%D8%B4-%D8%A3%D8%B5%D8%B9%D8%A8-%D9%81%D8%AA%D8%B1%D8%A7%D8%AA-%D8%AD%D9%8A%D8%A7%D8%AA%D9%87%D8%A7','كشفت تقارير صحافية أن اللاعبة الإسبانية جيني هيرموسو تعيش أصعب فتراتها في خضم الأزمة التي حدثت عقب تقبيل رئيس الاتحاد(...)','\n                        \n                            \n                        \n                        كشفت تقارير صحافية أن اللاعبة الإسبانية جيني هيرموسو تعيش أصعب فتراتها في خضم الأزمة التي حدثت عقب تقبيل رئيس الاتحاد الإسباني لويس روبياليس لها، أثناء تتويج فريقها بكأس العالم للسيدات.ومنذ أن أطلقت صافرة ختام كأس العالم للسيدات بين إسبانيا وإنجلترا، اشتعلت شرارة من الانتقادات وردود الأفعال السريعة على روبياليس عندما استقبل بطلات العالم على منصة التتويج ليحتضن هيرموسو أثناء مباركته ويقبلها، لتصدر عدة عقوبات عليه بدءا من إيقافه من \"فيفا\" الاتحاد الدولي لكرة القدم مؤقتا حتى الانتهاء من التحقيقات وفتح تحقيق من قبل النائب الإسباني بتهمة الاعتداء الجنسي.وذكرت صحيفة \"ماركا\" في تقرير لها: تمر جيني هيرموسو بواحدة من أكثر اللحظات تعقيدًا في حياتها، وجدت نفسها في بؤرة الأخبار واهتمام إعلامي لم تكن معتادة عليه، وسيتعين عليها التعامل معه حتى تحل القضايا العالقة مع العدالة وتتمكن من السفر إلى المكسيك لبدء الموسم الكروي الجديد.وتابعت: جيني تقضي هذه الأيام مع عائلتها وأصدقائها المقربين، محاموها نصحوها بالابتعاد عن منصات وسائل التواصل الاجتماعي وعدم الاستجابة للصحافيين، وما زالوا يدرسون إمكانية التقدم ببلاغ اعتداء جنسي للشرطة.وأكملت: تنوي هيرموسو حل القضية حتى تسافر إلى المكسيك للالتحاق بفريقها باتشوكا، ولم تتخذ قرارا بعد في إمكانية ملاحقة روبياليس قضائيا، مسؤولو باتشوكا لا يتوقعون وصول نجمتهم قريبا، وسيعملون على إبعادها عن وسائل الإعلام بمجرد انتهاء الأمر، لتصب تركيزها على كرة القدم فقط.\n                ','/uploads/2023/08/JVvhtARseg.webp',0,'published',8,2,1,'2023-08-31 18:05:39','2023-09-08 06:37:18'),
(30,'عادة غريبة.. هالاند ينام بشريط لاصق على فمه','عادة-غريبة..-هالاند-ينام-بشريط-لاصق-على-فمه','https://www.alarabiya.net/sport/2023/08/31/%D8%B9%D8%A7%D8%AF%D8%A9-%D8%BA%D8%B1%D9%8A%D8%A8%D8%A9-%D9%87%D8%A7%D9%84%D8%A7%D9%86%D8%AF-%D9%8A%D9%86%D8%A7%D9%85-%D8%A8%D8%B4%D8%B1%D9%8A%D8%B7-%D9%84%D8%A7%D8%B5%D9%82-%D8%B9%D9%84%D9%89-%D9%81%D9%85%D9%87','<p>كشف الدولي النرويجي إرلينغ هالاند مهاجم مانشستر سيتي الانجليزي، أنه ينام وفمه مغلق كجزء من نظام ليلي مكثّف يهدف إلى(...)','<p>كشف الدولي النرويجي إرلينغ هالاند مهاجم مانشستر سيتي الانجليزي، أنه ينام وفمه مغلق كجزء من نظام ليلي مكثّف يهدف إلى الحفاظ على مستواه الرائع مع فريقه الفائز بثلاثية تاريخية في الموسم الماضي.ويتبع هالاند روتينا غير معتاد في المساء يتضمن ربط الفم وارتداء نظارات زرقاء حاجبة للضوء لمدة ثلاث ساعات قبل الذهاب إلى النوم.وتحدث الشاب البالغ من العمر 23 عامًا عن عاداته الليلية في مقابلة مع مستخدم \"يوتيوب\" لوغان بول في بودكاست خاص به وقال: أعتقد أن النوم هو أهم شيء في العالم. أعتقد أن النوم الجيد، وأشياء بسيطة مثل النظارات الزرقاء، وحجب جميع الإشارات في غرفة النوم، أمر مهم حقًا.وتابع: يجب أن تحاول ربط فمك بشريط لاصق. أنا أنام به. إن القيام بالكثير من الأشياء ليس جيدًا، لكن القيام بأشياء صغيرة كل يوم لفترة أطول يؤتي ثماره حقًا.وقال هالاند إن سبب ربط فمه هو زيادة التنفس من خلال فتحتي الأنف، في حين أن التعرض لمصادر الضوء الأزرق، مثل الأجهزة الإلكترونية، يمكن أن يؤثر على النوم.من الواضح أن طقوس نوم النجم النرويجي ناجحة حيث سجل 52 هدفًا في مختلف المسابقات في موسمه الأول مع مانشستر سيتي، ما ساعد النادي على الفوز بدوري أبطال أوروبا والدوري الإنجليزي الممتاز والكأس المحلية.كما حقق رقما قياسيا لموسم واحد بتسجيله 36 هدفاً في البريميرليغ الموسم الماضي.وكشف هالاند في وقت سابق عن نظامه الغذائي الذي يعتمد على تناول قلب البقرة وكبدها، بالإضافة إلى مشروب مصنوع من الحليب واللفت والسبانخ، ساعده على طريق النجاح.</p>','/uploads/2023/08/I4pDsfkah8.webp',1,'published',26,2,4,'2023-08-31 18:05:54','2023-09-08 12:42:25'),
(31,'تشيلسي يعبر ويمبلدون بصعوبة في كأس الرابطة','تشيلسي-يعبر-ويمبلدون-بصعوبة-في-كأس-الرابطة','https://www.alarabiya.net/sport/international-sport/2023/08/31/%D8%AA%D8%B4%D9%8A%D9%84%D8%B3%D9%8A-%D9%8A%D8%B9%D8%A8%D8%B1-%D9%88%D9%8A%D9%85%D8%A8%D9%84%D8%AF%D9%88%D9%86-%D8%A8%D8%B5%D8%B9%D9%88%D8%A8%D8%A9-%D9%81%D9%8A-%D9%83%D8%A7%D8%B3-%D8%A7%D9%84%D8%B1%D8%A7%D8%A8%D8%B7%D8%A9','<p>صعد تشيلسي للدور الثالث في بطولة كأس رابطة المحترفين الإنجليزية، عقب فوزه الصعب 2 - 1 على ضيفه ويمبلدون يوم(...)','<p>صعد تشيلسي للدور الثالث في بطولة كأس رابطة المحترفين الإنجليزية، عقب فوزه الصعب 2 - 1 على ضيفه ويمبلدون يوم الأربعاء، في الدور الثاني للمسابقة.وعلى ملعب (ستامفورد بريدج) في العاصمة البريطانية لندن، اجتاز تشيلسي عقبة ويمبلدون، الذي ينافس بدوري الدرجة الثالثة الإنجليزي بصعوبة بالغة.وبادر ويمبلدون بالتسجيل عن طريق جيمس تيلي في الدقيقة 19 من ركلة جزاء، لكن نوني مادويكي أحرز هدف التعادل لتشيلسي في الدقيقة الأولى من الوقت المحتسب بدلا من الضائع للشوط الأول من ركلة جزاء أيضا.وفي الشوط الثاني، أضاف الأرجنتيني إنزو فيرنانديز الهدف الثاني لتشيلسي في الدقيقة 72، ليقود الفريق اللندني لمواصلة مشواره في البطولة التي توج بها 5 مرات، كان آخرها في موسم 2014 - 2015.من جانبه، حقق بلاكبيرن روفرز فوزا كاسحا 8 - صفر على مضيفه هاروغيت تاون، ليحجز مقعدا في الدور الثالث للمسابقة أيضا، كما صعد بيرنلي للدور ذاته، إثر فوزه 1 - صفر على مضيفه نوتنغهام فورست.وتقمص السويسري زكي أمدوني دور البطولة في اللقاء، عقب إحرازه هدف بيرنلي الوحيد في الدقيقة الأولى من الوقت الضائع للشوط الثاني.وفجر لينكولن سيتي، المنافس بدوري الدرجة الثانية، مفاجأة مدوية، بعدما أطاح بمضيفه شيفيلد يونايتد، الناشط بالدوري الإنجليزي الممتاز.وفاز لينكولن 3 - 2 على شيفيلد بركلات الترجيح، التي احتكم إليها الفريقان بعد انتهاء الوقت الأصلي بينهما بالتعادل بدون أهداف.</p>','/uploads/2023/08/9BI9LNmLWx.webp',1,'published',9,2,4,'2023-08-31 18:06:05','2023-09-08 12:42:20'),
(32,'كلاسيكو مثير بين الهلال والاتحاد في قمة الدوري السعودي','كلاسيكو-مثير-بين-الهلال-والاتحاد-في-قمة-الدوري-السعودي','https://www.alarabiya.net/sport/2023/08/31/%D9%83%D9%84%D8%A7%D8%B3%D9%8A%D9%83%D9%88-%D9%85%D8%AB%D9%8A%D8%B1-%D8%A8%D9%8A%D9%86-%D8%A7%D9%84%D9%87%D9%84%D8%A7%D9%84-%D9%88%D8%A7%D9%84%D8%A7%D8%AA%D8%AD%D8%A7%D8%AF-%D9%81%D9%8A-%D9%82%D9%85%D8%A9-%D8%A7%D9%84%D8%AF%D9%88%D8%B1%D9%8A-%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A-','<p>تتجه الأنظار يوم الجمعة إلى ملعب الأمير عبدالله الفيصل بجدة مسرح الكلاسيكو بين الاتحاد المتصدر وحامل اللقب والهلال بطل الموسم(...)','<p>تتجه الأنظار يوم الجمعة إلى ملعب الأمير عبدالله الفيصل بجدة مسرح الكلاسيكو بين الاتحاد المتصدر وحامل اللقب والهلال بطل الموسم قبل الماضي في قمة المرحلة الخامسة من دوري \"روشن\" السعودي للمحترفين.ويتصدر الاتحاد الدوري بالعلامة الكاملة برصيد 12 نقطة، وهو نفس عدد الأهداف التي هز بها الشباك في أقوى خط هجوم في الدوري حتى الآن بقيادة المغربي عبد الرزاق حمدالله الثاني في ترتيب الهدافين، والنجم الفرنسي كريم بنزيمة، فيما حافظ على نظافة شباكه في المراحل الأربع الماضية.ويتفوق الاتحاد بفارق الأهداف على جاره الأهلي وبفارق نقطتين أمام الهلال الذي سقط في فخ تعادل مخيب أمام ضيفه الفيحاء 1-1 في المرحلة الثانية.وسيحاول فريق مدينة جدة تأكيد صدارته ورد الاعتبار أمام الهلال الذي أخرجه قبل أقل من شهر من الدور ربع النهائي لمسابقة كأس الملك سلمان للأندية العربية بالفوز عليه 3-1.ويمني الاتحاد النفس بتعافي النجم والهداف السابق لريال مدريد الإسباني بنزيمة بعد إصابته في المباراة الماضية أمام الوحدة وغيابه عن تدريبات الأربعاء، والأمر ذاته بالنسبة للبرازيلي فابينو تافاريس.وقال مهاجمه البرازيلي رومارينيو إن الفريق متحمس لمواجهة الهلال \"وسنقدم كل ما لدينا للفوز بالمباراة، وهذا أمر طبيعي لأنها مهمة وستعطينا دافعا قويا للبقاء في القمة\".في المقابل، يتطلع الهلال إلى تأكيد أفضليته على مضيفه، والحاق الخسارة الأولى به في الدوري وانتزاع الصدارة منه ولو مؤقتا كون الأهلي يحل ضيفا على الفتح السبت.وشدد مدربه البرتغالي جورجي جيسوس على قوة خط دفاعه في التصدي للهجوم الاتحادي، وقال: السنغالي خاليدو كوليبالي قيمة كبيرة، وتواجده الى جانب حسان تمبكتي المنضم حديثاً من الشباب في التشكيل الأساسي، يعزز خط دفاع الهلال ويجعله أكثر صلابة.وعاد نيمار الذي كان يعاني من إصابة طفيفة الى التدريبات الجماعية، وقد يظهر في قائمة المباراة للمرة الأولى مع الفريق العاصمي.ويلعب الجمعة في بقية مباريات اليوم الأول من الجولة الخامسة الطائي وأبها، والفيحاء مع الرائد، بالإضافة إلى مباراة الرياض والأخدود.</p>','/uploads/2023/08/4zHW8oAdSy.webp',1,'published',10,2,6,'2023-08-31 19:00:04','2023-09-05 07:53:26'),
(33,'محرز يقود الأهلي إلى تجاوز الطائي','محرز-يقود-الأهلي-إلى-تجاوز-الطائي','https://www.alarabiya.net/sport/saudi-sport/2023/08/30/%D9%85%D8%AD%D8%B1%D8%B2-%D9%8A%D9%82%D9%88%D8%AF-%D8%A7%D9%84%D8%A3%D9%87%D9%84%D9%8A-%D8%A7%D9%84%D9%89-%D8%AA%D8%AC%D8%A7%D9%88%D8%B2-%D8%A7%D9%84%D8%B7%D8%A7%D8%A6%D9%8A-','<p>واصل الأهلي انتصاراته بفوزه على الطائي بهدفين نظيفين، يوم الثلاثاء، خلال المباراة التي جمعتهما في الجولة الرابعة من الدوري السعودي(...)','<p>واصل الأهلي انتصاراته بفوزه على الطائي بهدفين نظيفين، يوم الثلاثاء، خلال المباراة التي جمعتهما في الجولة الرابعة من الدوري السعودي للمحترفين (روشن).</p><p>أحرز ثنائية الأهلي الجزائري رياض محرز والإيفواري فرانك كيسي في الدقيقتين 39 و59.وشهدت المباراة طرد ألفا سيميدو لاعب الطائي في الدقيقة 35.</p><p>ورفع الأهلي رصيده إلى 12 نقطة في المركز الثاني، بفارق الأهداف خلف اتحاد جدة المتصدر، وتوقف رصيد الطائي عند ثلاث نقاط في المركز الرابع عشر.</p>','/uploads/2023/08/XpOqlVebbl.webp',1,'published',7,2,6,'2023-08-31 19:01:03','2023-09-08 06:46:19'),
(34,'ضربة جديدة لمانشستر يونايتد قبل مواجهة أرسنال','ضربة-جديدة-لمانشستر-يونايتد-قبل-مواجهة-أرسنال','https://www.alarabiya.net/sport/international-sport/2023/08/30/%D8%B6%D8%B1%D8%A8%D8%A9-%D8%AC%D8%AF%D9%8A%D8%AF%D8%A9-%D9%84%D9%85%D8%A7%D9%86%D8%B4%D8%B3%D8%AA%D8%B1-%D9%8A%D9%88%D9%86%D8%A7%D9%8A%D8%AA%D8%AF-%D9%82%D8%A8%D9%84-%D9%85%D9%88%D8%A7%D8%AC%D9%87%D8%A9-%D8%A3%D8%B1%D8%B3%D9%86%D8%A7%D9%84','<p>تأكد غياب رافاييل فاران عن صفوف مانشستر يونايتد الإنجليزي لكرة القدم لأسابيع بسبب الإصابة، حيث تفاقمت أزمة الإصابات بالفريق في(...)','<p>تأكد غياب رافاييل فاران عن صفوف مانشستر يونايتد الإنجليزي لكرة القدم لأسابيع بسبب الإصابة، حيث تفاقمت أزمة الإصابات بالفريق في الوقت الذي يستعد فيه لمواجهة أرسنال يوم الأحد المقبل.ويلتقي مانشستر يونايتد الذي يدربه المدير الفني إيريك تن هاغ، مع أرسنال يوم الأحد في آخر مبارياته قبل فترة التوقف الدولي، وسيفتقد العديد من لاعبيه الأساسيين.وتعرض كل من لوك شو وماسون مونت للإصابة في الأسبوع الأول من الموسم، بينما لم يسجل الوافد الجديد راسموس هويلوند مشاركته الأولى مع الفريق بعد بسبب مشكلة في الظهر، حسب ما أوضحته وكالة الأنباء البريطانية \"بي إيه ميديا\".وغاب تيريل مالاسيا وأماد ديالو وكوبي مانو وتوم هيتون عن الفريق في بداية الموسم، والآن انضم فاران إلى قائمة المصابين، وسيغيب لفترة عن الفريق.وذكر مانشستر يونايتد في بيان عبر موقعه الرسمي على الإنترنت يوم الأربعاء: سيغيب رافاييل فاران عن مانشستر يونايتد عندما يواجه أرسنال في الدوري الإنجليزي الممتاز يوم الأحد بسبب الإصابة.وأضاف: خرج الفرنسي الدولي في الشوط الأول خلال فوزنا 3 - 2 على نوتنغهام فورست في أولد ترافورد يوم السبت، بسبب إصابة من المتوقع أن تبعده عن الملاعب لبضعة أسابيع.وعلمت وكالة الأنباء البريطانية \"بي إيه ميديا\" أن مانشستر يونايتد يتوقع عودة فاران خلال فترة تقل عن ستة أسابيع، وهي الفترة التي توقعتها وسائل إعلام.وواجه فاران \"30 عاما\" عددا من مشكلات الإصابات منذ انضمامه إلى مانشستر يونايتد في عام 2021، ولا شك في أنه سيستغل فترة التوقف الدولي المقبلة في العمل من أجل التعافي والعودة.</p>','/uploads/2023/08/ximB8rWYwy.webp',1,'published',22,2,4,'2023-08-31 19:01:11','2023-09-08 12:42:23'),
(35,'«مهرجان أهداف» ..  الهلال يقلب الطاولة وينتصر  على الاتحاد في الدوري السعودي','«مهرجان-أهداف»-..-الهلال-يقلب-الطاولة-وينتصر-على-الاتحاد-في-الدوري-السعودي','http://www.al-mala3b.net/index.php?page=article&id=32474','<p>جريدة الملاعب - &nbsp;نجح فريق الهلال في تحقيق الفوز وقلب الطاولة أمام نظيره الاتحاد بنتيجة 4-3 في قمة مواجهات الجولة(...)','<p>جريدة الملاعب - &nbsp;نجح فريق الهلال في تحقيق الفوز وقلب الطاولة أمام نظيره الاتحاد بنتيجة 4-3 في قمة مواجهات الجولة الرابعة من دوري روشن السعودي للمحترفين 2023-2024.</p><p>&nbsp;</p><p>وبادر نادي الاتحاد بهدف أول بعد مرور 16 دقيقة عن طريق نجمه البرازيلي رومارينهو، ولم تمر سوى 4 دقائق حتى تعادل للهلال المهاجم الصربي ميتروفيتش بهدف رائع بعدما وصلته كرة عرضية من زميله سعود عبدالحميد.</p><p>&nbsp;</p><p>وأضاف كريم بنزيما الهدف الثاني للاتحاد في الدقيقة 38، وعزز حمدالله بالهدف الثالث في الدقيقة 45+8 في الشوط الأول.</p><p>&nbsp;</p><p>وخلال الشوط الثاني عاد ميتروفيتش ليسجل الهدفين الثانى والثالث للزعيم في شباك نظيره اتحاد جدة، بالدقيقتين 61 و65 (ركلة جزاء)، من زمن كلاسيكو الكرة السعودية وأضاف سالم الدوسري في تسجيل هدف الفوز في الدقيقة 71، لتنتهي المباراة بنتيجة 3-4.</p>','/uploads/2023/09/WOq88VlJe9.webp',1,'published',7,3,6,'2023-09-02 14:21:10','2023-09-08 06:26:25'),
(36,'مانشيني مدربا للمنتخب السعودي','مانشيني-مدربا-للمنتخب-السعودي','http://www.al-mala3b.net/index.php?page=article&id=32387','<p>جريدة الملاعب - أعلن الاتحاد السعودي لكرة القدم الأحد عن تعيين الإيطالي روبرتو مانشيني مدرباً للمنتخب الوطني الأول.</p><p>&nbsp;</p><p>وقال الاتحاد السعودي(...)','<p>جريدة الملاعب - أعلن الاتحاد السعودي لكرة القدم الأحد عن تعيين الإيطالي روبرتو مانشيني مدرباً للمنتخب الوطني الأول.</p><p>&nbsp;</p><p>وقال الاتحاد السعودي في حسابه على منصة \"اكس\" (تويتر سابقاً): شريطٌ من الذكريات تبدأ بعده رحلة كتابة التاريخ مع الأخضر.</p><p>&nbsp;</p><p>وبث حساب الاتحاد السعودي فيديو تقديمي للمدرب الجديد للمنتخب، ظهر من خلاله مانشيني يختار ربطة العنق باللون الاخضر وهو لون قميص المنتخب السعودي.</p><p>&nbsp;</p><p>وقال مانشيني:</p><p>&nbsp;</p><blockquote><p>&nbsp;صنعت التاريخ في أوروبا والآن جئت لصناعة التاريخ في السعودية.</p><p>&nbsp;</p></blockquote><p>خلال مسيرته الكروية، ارتدى مانشيني قميص سمبدوريا من عام 1982 إلى عام 1997، وشكل مع مواطنه الراحل أخيراً جانلوكا فيالي أحد أكثر الثنائيات الهجومية فعالية في الدوري الإيطالي.</p><p>&nbsp;</p><p>دافع عن الوان المنتخب الإيطالي في 36 مباراة وسجل 4 أهداف.</p><p>&nbsp;</p><p>استهل مانشيني مسيرته التدريبية مع فيورنتينا عام 2001، قبل أن يقود لاتسيو (2002-2004)، وإنتر (2004-2008 و2014-2016) وفاز بلقب \"سيري أ\" مرتين، ومانشستر سيتي (2009-2013) الذي قاده في عام 2012 إلى لقبه الأول كبطل للدوري الانجليزي منذ 44 عاماً.</p>','/uploads/2023/09/WcoZVNlh45.webp',1,'published',5,3,6,'2023-09-02 14:21:10','2023-09-05 07:53:40'),
(37,'الترجي يسعى لفسخ عقد \"شرارة\" ..  تعرف على السبب','الترجي-يسعى-لفسخ-عقد-\"شرارة\"-..-تعرف-على-السبب','http://www.al-mala3b.net/index.php?page=article&id=32484','<p>جريدة الملاعب - يسعى مسؤولو نادي الترجي الرياضي التونسي إلى إيجاد المخرج المناسب من أزمة خط الهجوم، حيث لم يستطع(...)','<p>جريدة الملاعب - يسعى مسؤولو نادي الترجي الرياضي التونسي إلى إيجاد المخرج المناسب من أزمة خط الهجوم، حيث لم يستطع حتى الآن تسجيل مهاجمه البرازيلي الجديد في قائمة الفريق بسبب اكتمال عدد المحترفين الأجانب.</p><p>&nbsp;</p><p>وتعمل إدارة الترجي حاليًا عل فسخ عقد المهاجم الجزائري رياض بن عيادة، ونجم منتخبنا الوطني محمد أبو زريق \'\'شرارة\'\' بالتراضي بهدف تأهيل المهاجم البرازيلي رودريجو رودريجيز، لضمه في قائمة أجانب الفريق.</p><p>&nbsp;</p><p>كما يسعى النادي إلى إيجاد حل لملف لاعب خط الوسط المصاب منذ فترة ليست بالقصيرة غيلان الشعلاني، والذي انتهى عقده منذ 30 يونيو/ حزيران الماضي، وسط أخبار تفيد بأن إدارة الفريق تنوي التمسك بصاحب الـ29 عامًا رغم الإصابة.</p><p>&nbsp;</p><p>يذكر أن مسؤولو نادي الترجي في مفاوضات جادة مع الملعب التونسي، من أجل ضم مهاجمه هيثم الجويني، وتم عقد جلسة قد تنتهي بتوقيعه لصالح الأحمر والأصفر.</p>','/uploads/2023/09/rj0tD4pHu2.webp',0,'published',7,3,6,'2023-09-03 14:23:02','2023-09-08 05:21:02'),
(38,'رونالدو يقتحم تاريخ الدوري السعودي برقم قياسي','رونالدو-يقتحم-تاريخ-الدوري-السعودي-برقم-قياسي','http://www.al-mala3b.net/index.php?page=article&id=32494','<p>جريدة الملاعب - واصل النجم البرتغالي كريستيانو رونالدو تحقيق الأرقام القياسية في الدوري السعودي، بعد أن سجل هدفا وصنع هدفين(...)','<p>جريدة الملاعب - واصل النجم البرتغالي كريستيانو رونالدو تحقيق الأرقام القياسية في الدوري السعودي، بعد أن سجل هدفا وصنع هدفين أمام الحزم (5-1)، ضمن الجولة الخامسة من المسابقة.وبات الدون أول لاعب في تاريخ الدوري يساهم في 10 أهداف خلال أول 5 جولات، (سجل 6 وصنع 4)، إذ تبلغ مساهماته 70% من أهداف النصر (15).</p><p>&nbsp;</p><p>وتربع رونالدو على صدارة هدافي الدوري برصيد 6 أهداف، بجانب تصدره لأكثر لاعب قدم تمريرات حاسمة (4)، متساويا مع زميله عبد الرحمن غريب.ورفع هدف الدون في مرمى الحزم رصيده التهديفي إلى 850 هدفا في مسيرته الاحترافية مع الأندية والمنتخب.</p><p>&nbsp;</p><p>وخاض كريستيانو 20 مباراة مع النصر، سجل خلالها 20 هدفا، وقدم 6 تمريرات حاسمة.وأصبح الحزم تاسع فريق بدوري المحترفين تهتز شباكه بواسطة الدون، بعد الفتح والوحدة وضمك والشباب والعدالة وأبها والرائد والطائي.</p>','/uploads/2023/09/CX9CLNa9Be.webp',1,'published',7,3,6,'2023-09-03 14:34:48','2023-09-08 05:21:11'),
(39,'اتحاد جدة يحسم صفقة راموس','اتحاد-جدة-يحسم-صفقة-راموس','https://www.kooora.com/?n=1266548','<p>حسم نادي اتحاد جدة صفقة التعاقد مع الإسباني سيرجو راموس، لاعب باريس سان جيرمان السابق، خلال فترة الانتقالات الصيفية الحالية.<br><br>وعلم(...)','<p>حسم نادي اتحاد جدة صفقة التعاقد مع الإسباني سيرجو راموس، لاعب باريس سان جيرمان السابق، خلال فترة الانتقالات الصيفية الحالية.<br><br>وعلم كووورة، أن راموس وقع للاتحاد لمدة موسمين، من أجل تدعيم خط دفاع الفريق في دوري روشن السعودي للمحترفين.<br>&nbsp;</p><p>وكان فابريزيو رومانو،&nbsp;خبير الانتقالات، قد صرح عبر حسابه على \"<strong>تويتر</strong>\"<strong> (إكس)</strong>: \"الاتحاد قدم عرضا بعقد لمدة موسمين، وينتظر قرار راموس النهائي، بسبب وجود تواصل بينه وبين أندية تركية\".<br><br>وتحرك الاتحاد لحسم صفقة راموس في أسرع وقت، مع تبقي 5 أيام فقط على غلق فترة الانتقالات الصيفية في السعودية.<br><br>وأبرمت الأندية السعودية العديد من الصفقات الكبرى، بداية من كريستيانو رونالدو في الشتاء الماضي، وتبعه هذا الصيف بنزيما وكانتي وفابينيو ونيمار ونيفيز وسافيتش وفيرمينو ومحرز وماني وبروزوفيتش وكوليبالي وبونو وتيليس وماكسيمين وفيجا، وغيرهم.</p>','/uploads/2023/09/fDcSLNcuoh.webp',0,'published',6,1,6,'2023-09-03 14:39:25','2023-09-08 05:20:53'),
(40,'دوري إفريقيا.. الأهلي وسيمبا يقصان شريط افتتاح النسخة الأولى','دوري-إفريقيا..-الأهلي-وسيمبا-يقصان-شريط-افتتاح-النسخة-الأولى','https://www.alarabiya.net/sport/2023/09/02/%D8%AF%D9%88%D8%B1%D9%8A-%D8%A7%D9%81%D8%B1%D9%8A%D9%82%D9%8A%D8%A7-%D8%A7%D9%84%D8%A3%D9%87%D9%84%D9%8A-%D9%88%D8%B3%D9%8A%D9%85%D8%A8%D8%A7-%D9%8A%D9%82%D8%B5%D8%A7%D9%86-%D8%B4%D8%B1%D9%8A%D8%B7-%D8%A7%D9%81%D8%AA%D8%AA%D8%A7%D8%AD-%D8%A7%D9%84%D9%86%D8%B3%D8%AE%D8%A9-%D8%A7%D9%84%D8%A3%D9%88%D9%84%D9%89','<p>يقص الأهلي المصري بطل دوري أبطال إفريقيا ومضيفه سيمبا التنزاني شريط افتتاح النسخة الأولى من دوري إفريقيا لكرة القدم التي(...)','<p>يقص الأهلي المصري بطل دوري أبطال إفريقيا ومضيفه سيمبا التنزاني شريط افتتاح النسخة الأولى من دوري إفريقيا لكرة القدم التي تجمع ثمانية أندية نخبوية من ثلاث مناطق إقليمية، حسب قرعة المسابقة السبت في القاهرة.وتُعدّ النسخة الأولى بمثابة مقدّمة لدوري أبطال إفريقيا الذي يضمّ 24 فريقاً في موسم 2024-2025. وقال الاتحاد الإفريقي (كاف) إن هذه البطولة الجديدة التي سيطلق عليها اسم دوري إفريقيا لكرة القدم African Football League هي \"شراكة\" بينه وبين الاتحاد الدولي (فيفا).وجاءت نتائج القرعة متوازنة حسب التصنيف الذي تم وضعه للفرق الثمانية، حيث سيلتقي الوداد الرياضي المغربي مع إنييمبا النيجيري، والترجي التونسي مع تي بي مازيمبي الكونغولي الديموقراطي، وماميلودي صنداونز الجنوب إفريقي مع أتلتيكو بتروليوس لواندا الأنغولي.وتنطلق المنافسات في الدور ربع النهائي بمباراتي ذهاب وإياب، يليه نصف النهائي والنهائي. وتقام البطولة على مدار أربعة أسابيع بدءاً من 20 أكتوبر في دار السلام، تنزانيا.يقام نصف النهائي بين 29 أكتوبر و1 نوفمبر، ومباراتا النهائي في 5 و11 نوفمبر.وبدلاً من نسخة تضمّ 24 نادياً تم الترويج لها سابقاً تحت اسم الدوري السوبر الإفريقي، تشارك ثمانية أندية في البطولة الجديدة تخوض بينها 14 مباراة.ولم يكشف الاتحاد القاري عن جوائز البطولة، علماً ان رئيسه الجنوب إفريقي باتريس موتسيبي قال العام الماضي في تنزانيا ان الفائز في الدوري السوبر سيحصد 11.5 مليون دولار أميركي.</p>','/uploads/2023/09/IPCKK4oNc7.webp',0,'published',3,2,6,'2023-09-03 14:48:47','2023-09-08 05:21:06'),
(41,'اتحاد جدة يغري نجم ريال مدريد بعرض متأخر','اتحاد-جدة-يغري-نجم-ريال-مدريد-بعرض-متأخر','https://www.kooora.com/?n=1266858','<p>قدم اتحاد جدة، عرضا من أجل التعاقد مع أحد اللاعبين البارزين في صفوف ريال مدريد، هذا الصيف.<br><br>ورغم انتهاء فترة الانتقالات(...)','<p>قدم اتحاد جدة، عرضا من أجل التعاقد مع أحد اللاعبين البارزين في صفوف ريال مدريد، هذا الصيف.<br><br>ورغم انتهاء فترة الانتقالات في أوروبا، إلا أنها لا زالت مستمرة حتى الخميس المقبل في الدوري السعودي، الذي استقطب العديد من النجوم حول العالم.<br><br>وقالت شبكة \"<strong>ديفنسا سنترال</strong>\"، إن اتحاد جدة قدم عرضا لضم النمساوي ديفيد ألابا، مدافع الريال (الذي يرتبط بتعاقد مع الميرنجي حتى 2026)، مقابل 40 مليون يورو.<br><br>ويأمل اتحاد جدة النجاح في حسم الصفقة خلال اللحظات الأخيرة من الميركاتو الصيفي.<br><br>وأشارت الشبكة الإسبانية، إلى أن الاتحاد عرض على ألابا، راتبا يبلغ 25 مليون يورو سنويا،&nbsp;وهو مبلغ أعلى كثيرا مما يتقاضاه مع النادي الملكي.<br><br>وأوضحت الشبكة، أن ألابا لا يميل للانتقال للدوري السعودي، ويرغب في مواصلة الدفاع عن ألوان الريال خلال الموسم الحالي، خاصة مع النقص العددي في صفوف الفريق الملكي، في ظل إصابة البرازيلي إيدير ميليتاو.<br><br>&nbsp;</p>','/uploads/2023/09/KznNsFChPt.webp',1,'published',5,1,6,'2023-09-04 11:56:58','2023-09-08 06:32:59'),
(42,'إنريكي يرد على نيمار','إنريكي-يرد-على-نيمار','https://www.kooora.com/?n=1266825','رد لويس إنريكي، مدرب باريس سان جيرمان على تصريحات نيمار جونيور، نجم الفريق السابق، التي هاجم فيها النادي الفرنسي.  قال...','&#1585;&#1583; &#1604;&#1608;&#1610;&#1587; &#1573;&#1606;&#1585;&#1610;&#1603;&#1610;&#1548; &#1605;&#1583;&#1585;&#1576; &#1576;&#1575;&#1585;&#1610;&#1587; &#1587;&#1575;&#1606; &#1580;&#1610;&#1585;&#1605;&#1575;&#1606; &#1593;&#1604;&#1609; &#1578;&#1589;&#1585;&#1610;&#1581;&#1575;&#1578; &#1606;&#1610;&#1605;&#1575;&#1585; &#1580;&#1608;&#1606;&#1610;&#1608;&#1585;&#1548; &#1606;&#1580;&#1605; &#1575;&#1604;&#1601;&#1585;&#1610;&#1602; &#1575;&#1604;&#1587;&#1575;&#1576;&#1602;&#1548; &#1575;&#1604;&#1578;&#1610; &#1607;&#1575;&#1580;&#1605; &#1601;&#1610;&#1607;&#1575; &#1575;&#1604;&#1606;&#1575;&#1583;&#1610; &#1575;&#1604;&#1601;&#1585;&#1606;&#1587;&#1610;.<br /><br />&#1602;&#1575;&#1604; &#1606;&#1610;&#1605;&#1575;&#1585; &#1593;&#1576;&#1585; &#1588;&#1576;&#1603;&#1577; &quot;<strong>&#1580;&#1604;&#1608;&#1576;&#1608;</strong>&quot; &#1575;&#1604;&#1576;&#1585;&#1575;&#1586;&#1610;&#1604;&#1610;&#1577;<strong>&nbsp;</strong>&#1571;&#1606;&#1607; &#1593;&#1575;&#1588; &#1580;&#1581;&#1610;&#1605;&#1575; &#1605;&#1593; &#1604;&#1610;&#1608;&#1606;&#1610;&#1604; &#1605;&#1610;&#1587;&#1610;&#1548; &#1582;&#1604;&#1575;&#1604; &#1575;&#1604;&#1605;&#1608;&#1587;&#1605; &#1575;&#1604;&#1605;&#1575;&#1590;&#1610; &#1605;&#1593; &#1575;&#1604;&#1601;&#1585;&#1610;&#1602; &#1575;&#1604;&#1576;&#1575;&#1585;&#1610;&#1587;&#1610;.<br /><br />&#1608;&#1593;&#1604;&#1602; &#1573;&#1606;&#1585;&#1610;&#1603;&#1610; &#1593;&#1576;&#1585; &#1589;&#1581;&#1610;&#1601;&#1577; &quot;<strong>&#1604;&#1608; &#1576;&#1575;&#1585;&#1610;&#1586;&#1610;&#1575;&#1606;</strong>&quot;: &quot;&#1573;&#1606;&#1607;&#1575; &#1578;&#1580;&#1585;&#1576;&#1578;&#1607;&#1605;&#1575; &#1575;&#1604;&#1588;&#1582;&#1589;&#1610;&#1577;&#1548; &#1603;&#1604; &#1588;&#1582;&#1589;