(43,'محرز يقدم وعدًا لجماهير الأهلي','محرز-يقدم-وعدًا-لجماهير-الأهلي','https://www.kooora.com/?n=1266836','<p>اعتذر رياض محرز نجم أهلي جدة، لجماهير ناديه بعد الخسارة القاسية أمام مضيفه الفتح (5-1)، في الجولة الخامسة من دوري(...)','<p>اعتذر رياض محرز نجم أهلي جدة، لجماهير ناديه بعد الخسارة القاسية أمام مضيفه الفتح (5-1)، في الجولة الخامسة من دوري روشن السعودي للمحترفين.<br><br>وقال محرز في تصريحات تليفزيونية: \"إنها كرة القدم.. أحيانا تفوز وأخرى تخسر.. أعتقد أننا كنا جيدين في الشوط الأول، وسيطرنا على المباراة\".<br>&nbsp;<br>وواصل: \"وقعنا في بعض الأخطاء التي تحدث في كرة القدم بالشوط الثاني، وخسرنا في النهاية\".<br>&nbsp;<br>وأضاف: \"نعتذر لجماهيرنا على خسارتنا الأولى، لكننا سنعود بقوة أكبر إن شاء الله، وسنفوز في المباراة المقبلة\".<br>&nbsp;<br>وتوقف رصيد الأهلي بعد تلك الخسارة عند 12 نقطة، وتراجع للمركز الرابع، في حين رفع الفتح رصيده إلى 8 نقاط في المركز السابع.<br>&nbsp;</p>','/uploads/2023/09/rUOM12Qo4b.webp',1,'published',9,1,6,'2023-09-04 11:56:58','2023-09-08 05:21:15'),
(44,'إنتر يعتلي قمة الدوري الإيطالي برباعية في فيورنتينا','إنتر-يعتلي-قمة-الدوري-الإيطالي-برباعية-في-فيورنتينا','https://www.alarabiya.net/sport/2023/09/03/%D8%A7%D9%86%D8%AA%D8%B1-%D9%8A%D8%B9%D8%AA%D9%84%D9%8A-%D9%82%D9%85%D8%A9-%D8%A7%D9%84%D8%AF%D9%88%D8%B1%D9%8A-%D8%A7%D9%84%D8%A7%D9%8A%D8%B7%D8%A7%D9%84%D9%8A-%D8%A8%D8%B1%D8%A8%D8%A7%D8%B9%D9%8A%D8%A9-%D9%81%D9%8A-%D9%81%D9%8A%D9%88%D8%B1%D9%86%D8%AA%D9%8A%D9%86%D8%A7','واصل إنتر ميلان انطلاقته المثالية في بطولة الدوري الإيطالي لكرة القدم هذا الموسم، واعتلى صدارة جدول ترتيب المسابقة.وحقق إنتر انتصارا(...)','\n                        \n                            \n                        \n                        واصل إنتر ميلان انطلاقته المثالية في بطولة الدوري الإيطالي لكرة القدم هذا الموسم، واعتلى صدارة جدول ترتيب المسابقة.وحقق إنتر انتصارا كبيرا 4 - صفر على ضيفه فيورنتينا، في المرحلة الثالثة لمسابقة الدوري الإيطالي، التي شهدت أيضا فوز تورينو 1 - صفر على ضيفه جنوى.وافتتح الفرنسي ماركوس تورام التسجيل لإنتر في الدقيقة 23، فيما أضاف الأرجنتيني لاوتارو مارتينيز الهدف الثاني للفريق الملقب بـ(الأفاعي) في الدقيقة 53.وأضاف التركي هاكن كالهانوغلو الهدف الثالث لإنتر في الدقيقة 58، قبل أن يعود مارتينيز لهز الشباك من جديد، بتسجيله الهدف الرابع لأصحاب الأرض وهدفه الشخصي الثاني في الدقيقة 73.ورفع إنتر، الذي فاز في جميع مبارياته الثلاث الأولى في المسابقة هذا الموسم، إلى 9 نقاط، محققا العلامة الكاملة حتى الآن، ليتربع على الصدارة، متفوقا بفارق الأهداف على أقرب ملاحقيه جاره اللدود ميلان، المتساوي معه في نفس الرصيد.ويمتلك إنتر أقوى خط هجوم في البطولة هذا الموسم، بتسجيله 8 أهداف، بالتساوي مع ميلان، علما بأنه الفريق الوحيد الذي مازال محافظا على نظافة شباكه في المسابقة حتى الآن.في المقابل، توقف رصيد فيورنتينا، الذي تلقى خسارته الأولى في البطولة هذا الموسم، عند 4 نقاط في المركز الثامن.\n                \n            ','/uploads/2023/09/sMMCjNGtRE.webp',0,'published',3,2,1,'2023-09-04 12:03:37','2023-09-08 06:32:58'),
(45,'هدف رايس القاتل يهدي أرسنال فوزاً مثيراً على مانشستر يونايتد','هدف-رايس-القاتل-يهدي-أرسنال-فوزاً-مثيراً-على-مانشستر-يونايتد','https://www.alarabiya.net/sport/2023/09/03/%D9%87%D8%AF%D9%81-%D8%B1%D8%A7%D9%8A%D8%B3-%D8%A7%D9%84%D9%82%D8%A7%D8%AA%D9%84-%D9%8A%D9%87%D8%AF%D9%8A-%D8%A3%D8%B1%D8%B3%D9%86%D8%A7%D9%84-%D9%81%D9%88%D8%B2%D8%A7-%D9%85%D8%AB%D9%8A%D8%B1%D8%A7-%D8%B9%D9%84%D9%89-%D9%85%D8%A7%D9%86%D8%B4%D8%B3%D8%AA%D8%B1-%D9%8A%D9%88%D9%86%D8%A7%D9%8A%D8%AA%D8%AF','<p>أحرز ديكلان رايس وغابرييل جيسوس هدفين في الوقت بدل الضائع ليفوز أرسنال 3-1 على مانشستر يونايتد في مباراة مثيرة بالدوري(...)','<p>أحرز ديكلان رايس وغابرييل جيسوس هدفين في الوقت بدل الضائع ليفوز أرسنال 3-1 على مانشستر يونايتد في مباراة مثيرة بالدوري الإنجليزي الممتاز لكرة القدم يوم الأحد.</p><p>وتقدم ماركوس راشفورد بهدف ليونايتد بعد هجمة مرتدة سريعة في الدقيقة 27، لكن مارتن أوديغارد أدرك التعادل لأرسنال بعد دقيقة واحدة بفضل تسديدة أرضية قوية.وبدا أن المباراة ستنتهي بالتعادل 1-1، قبل أن يستقبل رايس، المنضم هذا الصيف في صفقة ضخمة، ركلة ركنية من بوكايو ساكا ويطلق تسديدة قوية داخل شباك الحارس أندريه أونانا في الدقيقة السادسة من الوقت بدل الضائع.</p><p>وفي الدقيقة 11 من الوقت بدل الضائع، ومن هجمة مرتدة سريعة، انفرد جيسوس بمرمى أونانا وسدد كرة أرضية بهدوء داخل الشباك.وتقدم أرسنال إلى المركز الخامس برصيد عشر نقاط، وبفارق نقطتين عن مانشستر سيتي المتصدر وحامل اللقب وصاحب العلامة الكاملة، بينما تراجع يونايتد إلى المركز 11 برصيد ست نقاط من أربع مباريات.</p><p>ويملك توتنهام هوتسبير وليفربول ووست هام يونايتد عشر نقاط.</p>','/uploads/2023/09/aB9t72gbCy.webp',0,'published',8,2,4,'2023-09-04 12:03:37','2023-09-08 07:35:43'),
(46,'نيمار يكشف: هربت مع ميسي من جحيم باريس','نيمار-يكشف:-هربت-مع-ميسي-من-جحيم-باريس','https://www.alarabiya.net/sport/international-sport/2023/09/03/%D9%86%D9%8A%D9%85%D8%A7%D8%B1-%D9%8A%D9%83%D8%B4%D9%81-%D9%87%D8%B1%D8%A8%D8%AA-%D9%85%D8%B9-%D9%85%D9%8A%D8%B3%D9%8A-%D9%85%D9%86-%D8%AC%D8%AD%D9%8A%D9%85-%D8%A8%D8%A7%D8%B1%D9%8A%D8%B3-','<p>وصف البرازيلي نيمار دا سيلفا، لاعب نادي الهلال السعودي، تجربته السابقة مع باريس سان جيرمان بـ\"الجحيم\"، مشيرا إلى أنه شعر(...)','<p>وصف البرازيلي نيمار دا سيلفا، لاعب نادي الهلال السعودي، تجربته السابقة مع باريس سان جيرمان بـ\"الجحيم\"، مشيرا إلى أنه شعر بالضيق خلال فترته مع الفريق الفرنسي بجانب الأسطورة ليونيل ميسي.</p><p>وقال النجم نيمار في مقابلة مع صحيفة \"أو غلوبو\" البرازيلية، يوم الأحد:&nbsp;</p><blockquote><p>كنت سعيدا لميسي بعد تحقيقه لقب كأس العالم 2022 مع منتخب الأرجنتين، وفي ذات الوقت حزين للغاية، لأنه عاش فترة صعبة، ذهب من جحيم باريس سان جيرمان إلى جنة المنتخب الأرجنتيني.</p></blockquote><p>وأضاف المهاجم:&nbsp;</p><blockquote><p>فاز بكل شيء في السنوات الأخيرة، لكن عاش في جحيم مع باريس سان جيرمان، عشنا الجحيم سويا أنا وهو، شعرنا بالضيق، جئنا إلى النادي الفرنسي من أجل تقديم أفضل ما لدينا، لنكون أبطالا ولمحاولة صنع التاريخ، لذلك عدنا للعب معا في باريس، اتحدنا هناك حتى نتمكن من صنع التاريخ، ولسوء الحظ لم ننجح.</p></blockquote><p>وأردف نيمار:&nbsp;</p><blockquote><p>غادر ميسي باريس بطريقة لم يستحقها، وقد اتهم بطريقة غير عادلة في رأيي، لكن في الوقت نفسه كنت سعيدا جدا بفوزه بكأس العالم، كما قلت كانت كرة القدم عادلة معه هذه المرة، استحق ميسي إنهاء مسيرته بالحصول على المونديال.</p></blockquote>','/uploads/2023/09/PmZGOIyzGt.webp',1,'published',10,2,5,'2023-09-04 12:03:37','2023-09-08 06:52:34'),
(47,'كلوب \"ضاحكاً\": رحيل صلاح قصة إعلامية','كلوب-\"ضاحكاً\":-رحيل-صلاح-قصة-إعلامية','https://www.alarabiya.net/sport/international-sport/2023/09/03/%D9%83%D9%84%D9%88%D8%A8-%D8%B6%D8%A7%D8%AD%D9%83%D8%A7%D9%8B-%D8%B1%D8%AD%D9%8A%D9%84-%D8%B5%D9%84%D8%A7%D8%AD-%D9%82%D8%B5%D8%A9-%D8%A7%D8%B9%D9%84%D8%A7%D9%85%D9%8A%D8%A9-','<p>انفجر يورغن كلوب، مدرب ليفربول، ضاحكا بعد سؤاله عن إمكانية رحيل محمد صلاح عن الفريق الإنجليزي، مشددا على أن نجمه(...)','<p>انفجر يورغن كلوب، مدرب ليفربول، ضاحكا بعد سؤاله عن إمكانية رحيل محمد صلاح عن الفريق الإنجليزي، مشددا على أن نجمه المصري لن يخرج خارج أسوار النادي.</p><p>وبدأ صلاح أساسيا مع \"الريدز\" ضد أستون فيلا في المباراة التي استضافها ملعب \"أنفيلد\"، يوم الأحد، على الرغم من التكهنات الشديدة بشأن مستقبله.</p><p>وذكرت التقارير البريطانية أن ليفربول رفض عرضا في اليوم الأخير من اتحاد جدة من أجل الحصول على توقيع محمد صلاح، قبل إغلاق سوق الانتقالات الصيفية في إنجلترا.</p><p>وعندما سئل المدرب الألماني عما إذا كان صلاح سيرحل عن ليفربول أم لا، ضحك كلوب علنا، وقال: إنها قصة إعلامية، لدي العديد من الأورواق في مكتبي، ولا يوجد أي شيء بشأن رحيل صلاح.</p><p>وأضاف: لدي الكثير من الأشياء الأخرى التي يجب القيام بها، لقد خاض صلاح أسبوعا تدريبا جيدا وطبيعيا، لم يكن هناك شيء من وجهة نظري للتفكير فيه.</p>','/uploads/2023/09/19BFQ9e2LB.webp',0,'published',11,2,4,'2023-09-04 12:03:37','2023-09-08 06:34:13');
