(1,'كوورة لايف','موقع متخصص في أخبار كرة القدم وتغطية الأحداث الحية. اكتشف أحدث التحديثات والأخبار حول مباريات كرة القدم والأحداث الرياضية المباشرة. نقدم تقارير دقيقة وموثوقة عن أبرز اللحظات في عالم الساحرة المستديرة. تابع تحليلاتنا العميقة لأداء الفرق واللاعبين، واحصل على جداول المباريات ونتائجها على الفور. انضم إلى مجتمع العشاق لكرة القدم وشارك في مناقشات ممتعة. إذا كنت تبحث عن مصدر موثوق لأخبار كرة القدم وتغطية مبارياتها، فأنت في المكان الصحيح. اكتشف عالم كرة القدم معنا وكن جزءًا من هذه الرحلة الرياضية الممتعة.',1,'https://cdn.kouralive.net','2023-07-03 14:54:47','2023-09-03 13:59:03','2023');
